MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Verification Run Manager (VRM) provides a mechanism for the user to define an arbitrary number of regression tasks, execute the entire set of tasks, or any subset of tasks with a single command.");
MGCAddSnippet(6, "Following are some use models for VRM:");
MGCAddSnippet(7, "This tutorial walks through the process of setting up a VRM Run Manager DataBase (RMDB) manually. ");
MGCAddSnippet(8, "You can find the source files for this example tutorial can be found in the <install_dir>/examples/vrm/simple directory. ");
MGCAddSnippet(9, "The RMDB for the tutorial is named default.rmdb.");
MGCAddSnippet(10, "An XML file is similar in structure to an HTML file. Data or text items are assigned a significance by marking them with tags (short identifiers surrounded in angle brackets). For example,");
MGCAddSnippet(11, "The Verification Run Manager DataBase (RMDB) file is the VRM database. The RMDB file contains data for one or more regression test suites arranged in a hierarchical tree topology, which allows the user to group tests and other tasks in various ways.");
