MGCAddSnippet(14, "Parameters can be added to any runnable element. A parameter is a name/value pair expressed as an XML element. The name of the parameter is specified as an attribute of the parameter element, and the contents of that element define the parameter's value. ");
MGCAddSnippet(15, "To compile once and then run multiple tests, place your compile information in a preScript because that is what happens once; and you put the simulation in the execScript because that is what happens multiple times. If you need to run multiple tests, each with its own compile step, then you have nothing that you need to do only once at the beginning of the run so there is no need for a preScript.");
MGCAddSnippet(16, "As mentioned before, each of the tests in the  random  group can use the same basic execution script, except that a different seed value is used each time. In order to save a lot of typing, if a leaf-level task does not define an execScript element, the chain of calling  parentage  is scanned until an execScript element is found (this only happens in the case of an execScript). To take advantage of the search algorithm, add the execScript element containing the random test execution commands to the  random  runnable element as follows:");
