MGCAddSnippet(22, "VRM creates a VRMDATA directory in the current working directory. This is the root of a tree of working directories created to run the various tasks specified in the regression suite. Beneath this directory is a single nightly directory in which the  nightly  group is run. Beneath this are the directed and random directories and beneath each of these directories are subdirectories named for each leaf-level test. For example, the directory VRMDATA/nightly/random/randtest1 should contain the following files:");
