MGCAddSnippet(25, "This chapter describes basic operation aspects of the VRM.");
MGCAddSnippet(26, "VRM has several major modes of operation, which are determined by the presence of command-line options. ");
MGCAddSnippet(27, "Execution mode is used to launch one or more regression Actions, as defined in the Verification Run Manager DataBase (RMDB) file. The RMDB file is the VRM database. The RMDB file generally contains data for one or more regression test suites arranged in a hierarchical tree topology, which allows the user to group tests and other tasks in various ways.");
MGCAddSnippet(28, "The control/abort mode allows the user to abort a currently running vrun process. The -kill option causes vrun to attempt to connect to the running process via its TCP/IP control port. If successful, it sends the listening process the kill command, which causes the regression run to terminate.");
MGCAddSnippet(29, "Status mode causes vrun to emit a status report on a previously completed or currently running regression run. The -status option causes vrun to read one or more event log(s), previously saved to the logs subdirectory of the designated VRM Data directory, and format a status report on stdout summarizing the status of each Action executed in that VRMDATA directory.");
MGCAddSnippet(30, "Notification mode is used to communicate changes in job status to a master VRM process, and notify an existing VRM instance that a specific Action has completed. The user generally does not need to deal with this mode, as the notification mode command is called from the same wrapper script used to launch the job in question.");
MGCAddSnippet(31, "Use this mode to launch interactive simulations from VRM.");
MGCAddSnippet(32, "The Verification Run Manager DataBase (RMDB) file is the VRM database.");
MGCAddSnippet(33, "Certain input files can contain user comments. The RMDB database file is written using XML and accepts comments according to the XML standard. For example,");
MGCAddSnippet(34, "In some cases, an RMDB file is configured with the assumption that one or more command-line options are always used whenever vrun uses that particular database. In this case, these precanned options can be embedded in the RMDB file by adding an options attribute to the document (rmdb) element. For example,");
MGCAddSnippet(35, "VRM supports a  dry run  through a given set of selected Runnables where the scripts and other supporting files and directories in the VRMDATA area are generated but the scripts are not launched.");
MGCAddSnippet(36, "By default, VRM looks for its database in the default.rmdb file in the current directory. If the MTI_VRUN_DB environment variable is set, then the contents of that variable are read and used as the (relative or absolute) path to the RMDB database file.");
MGCAddSnippet(37, "The VRM database is an XML file. By default, the contents of an XML file are validated against the Document Type Definition (DTD) file located in the Questa release tree at vm_src/rmdb.dtd. The XML file is validated against the DTD provided with the release from which the vrun command is launched. Validation occurs after the XML file has been parsed and loaded. If there are validation errors in the XML file, they are printed by the parser library (to stdout), an error message is emitted from VRM, and the vrun process exits.");
MGCAddSnippet(38, "The VRM database supports XInclude (mechanism for merging XML documents), allowing the database contents to be divided among multiple files. The  parent  file will still contain the document (rmdb) element and also specify one or more xi:include elements in the XInclude namespace. In that case, the file referred to by the xinclude element is read into the VRM database in place of the xinclude element.");
MGCAddSnippet(39, "Like most Questa executables, VRM can be executed by typing the full path to the vrun executable, even if the Questa install directory is not included in the search path (that is, the PATH environment variable). If the Action scripts defined in the database are all TCL scripts (the default), then they are run from within a vsim shell invoked using the same path as that used to invoke VRM. In other words, everything should just work, even if the Questa install directory is not included in the user's PATH.");
MGCAddSnippet(40, "VRM maintains a working directory tree in which all Action scripts are executed. The directory hierarchy follows the Group membership hierarchy as given in the database. At the top of the tree is the VRMDATA directory (determined by  -vrmdata directory  command-line option, or ./VRMDATA by default). Under that directory are subdirectories for each of the top-level Runnables named on the command line. For those Runnables that are Groups, subdirectories are created under the working directory for that Group (recursively until the leaf-level Tasks are reached).");
MGCAddSnippet(41, "This section describes the types of information reported by vrun about your regression run and the individual action scripts. ");
MGCAddSnippet(42, "After the completion of every regression run, the following status reports are automatically written to the transcript.");
MGCAddSnippet(43, "Specifying the  vrun -exitcodes  command and argument enables the reporting on the general status of the action scripts within the regression run.");
MGCAddSnippet(44, "You can create a status report, in text or HTML format, that provides information about the most recent run executed in the current VRMDATA directory.");
MGCAddSnippet(45, "For detailed information about the arguments mentioned, or an overview other arguments, refer to:");
MGCAddSnippet(46, "For detailed information about the arguments mentioned, or an overview other arguments, refer to:");
MGCAddSnippet(47, "For detailed information about the arguments mentioned, or an overview other arguments, refer to ");
MGCAddSnippet(48, "VRM advanced tasks are described below.");
MGCAddSnippet(49, "The following shows an example report when using the default settings (Note that the columns have been shortened for formatting reasons).");
MGCAddSnippet(50, "The HTML status report contains three primary areas on the main page as well as a page for each individual action.");
MGCAddSnippet(51, "The Status Report Output Columns table provides an overview of all the columns available in the text and HTML reports and the VRM Results window of the GUI.");
MGCAddSnippet(52, "VRM maintains a VRM Data directory tree under which each Action executed is assigned a directory based on its context chain. ");
MGCAddSnippet(53, "Even though VRM can be used in any number of regression-like flows, the most common is the Questa compile-simulate flow. In this flow, some number of HDL source files are compiled into a working library and said library is referenced by some number of simulations. In a typical traditional flow, the compilation commands and the simulations commands are commonly run in the same directory.");
MGCAddSnippet(54, "VRM can recursively call itself, thus encapsulating key command-line options into the database. VRM can run any legal command as part of an Action script, including the vrun command itself. This property of VRM can be exploited to provide a robust methodology for encapsulating one or more vrun commands into a higher-level macro-like Runnable object.");
MGCAddSnippet(55, "By default, VRM launches Actions as soon as they become eligible (that is, as soon as any dependencies are met). This means that, in many cases, it is possible for VRM to attempt to launch a large number of concurrent processes at one time.");
MGCAddSnippet(56, "The procedure for overriding the repeat count of any given Task or Group depends on how the Runnable is specified. ");
MGCAddSnippet(57, "VRM does not provide compute grid management, nor is it tied to any particular compute grid management product. While this allows VRM to be used in a wide variety of end-user environments, the generalized flexibility comes at the price of tight integration.");
MGCAddSnippet(58, "Regardless of the grid system in use, the way to control how Actions are launched is through execution methods. An execution method is basically a script-launching command. When an execution method is involved, the vrun process writes a batch (.bat) file that contains the vsim/vish command needed to launch the Action. It then passes the name of this batch file to the execution method command. If this execution method command happens to be a grid-submission command, then the Action is queued to the associated grid.");
MGCAddSnippet(59, "Once VRM launches the batch file that queues a job to a grid system, the only control and/or visibility is via the log files produced by the job and the utilities provided by the grid system itself. In order to interact with the various log files and utilities flexibly enough to accommodate a wide variety of grid software variants, a number of user-definable procedures are used. These particular user-definable procedures, however, are named for the grid system to which they were intended to interface. In other words, each grid system supported by VRM will have its own set of user-definable procedures. Additional user-definable procedures can be define by the user to support in-house grid systems as well.");
MGCAddSnippet(60, "Every grid system includes a way to identify jobs queued to the grid. In the LSF, UGE, SGE and RTDA products, these JobId are numeric strings. ");
MGCAddSnippet(61, "The start/done and pass/fail status of Actions launched on a grid system is still communicated to the launching vrun process via the TCP/IP channel opened for that purpose. That means that the machine on which the launching vrun process is running and the machine(s) on which the Action(s) will ultimately run must be connected via a network and that the launching machine must be visible from the grid machines.");
MGCAddSnippet(62, "To kill a queued/running job, a user-definable procedure corresponding to the function name KillJob is called. In the case of the UGE example, the procedure name is UgeKillJob. By default, this procedure scans xxxScript.stdout for a JobId. Upon finding a JobId corresponding to the Action in question, it is passed to the qdel command to terminate the job. The vrun process only calls this user-defined procedure in the event the Action fails with a timeout (in which case the KillJob operation is simply a precaution) or in the case where the regression is manually killed by the user.");
MGCAddSnippet(63, "VRM database (RMDB file) generally contains data for one or more regression test suites arranged in a hierarchical tree topology that allows the user to group tests and other tasks in various ways. Each node in this tree is known as a  Runnable  because it could, in theory, be designated as one of the top-most nodes to be executed in any given regression run. Command-line options are used to designate which part(s) of this hierarchy are to be executed.");
MGCAddSnippet(64, "The vrun command supports a -show option that, rather than actually running the selected regression Actions, simply lists what is selected by the other command-line options and, therefore, what would run if the -show option is not used.");
MGCAddSnippet(65, "In the RMDB file, Groups and Tasks can be defined as either conditional or repeating. Conditional Runnables do not have any special notation, as they are either present under the specified conditions or not. However, repeating Runnables are expanded into multiple copies/instances and the Runnable selection notation needs to accommodate the selection of one or more of a set of repeating Runnables.");
MGCAddSnippet(66, "Wildcards (either glob-based or regexp-based) can be used to select instance identifiers from a repeating Runnable. A Runnable will repeat when defined with a repeat attribute whose value is larger than one or when defined with a foreach attribute containing more than one comma/space separated value.");
MGCAddSnippet(67, "The contents of the event log from the most recent vrun regression run can be used as the basis for Runnable selection. As VRM executes Actions, it records their status in an event log. The user can select, for example, all Actions that passed, all Actions that failed, all Actions that were not run, or any combination of this list. In this case, instead of specifying a list of context paths, the user can use the -select command-line option followed by one or more comma-separated keywords. For example,");
MGCAddSnippet(68, "In many cases, the Actions defined in a given Runnable depend on context from ancestor Runnables (parents or parents-of-parents at any depth). For example, a parameter needed to resolve a command in an Action script can be defined at a higher level in the hierarchy. In such cases, it is possible for the user to supply the necessary parameter value directly on the command line. However, it is more common for the given Runnable to be executed  in context . This means that when the Runnable is selected, its ancestors are also specified on the command line as follows:");
MGCAddSnippet(69, "Any Runnable can be used as the root of a context chain. ");
MGCAddSnippet(70, "By default, glob characters (*, ?, [<char>...], and {<string>,...}) can be used in any component of a context chain. The matching is done according to the rules specified for the Tcl glob command.");
MGCAddSnippet(71, "While the globbing characters provide a great deal of flexibility in selecting multiple Runnables with one context chain, even more selection flexibility can be obtained by adding the -regex option to the vrun command line. ");
MGCAddSnippet(72, "By default, only context chains that represent actual nodes in the topology of the regression suite defined in the RMDB file are considered valid. For example, the following command:");
MGCAddSnippet(73, "The batch mode VRM vrun utility supports a number of command-line options aimed at making VRM more accessible to end users. The assumption is that the end-user (who might not be the same person who built-up the RMDB file) does not know which tests and/or parametric options are available to use without studying the RMDB file itself. ");
MGCAddSnippet(74, "Viewing the contents of an RMDB file primarily means viewing the Runnable hierarchy. The -show option requests vrun to display some subset of Runnables defined in the RMDB file in a user-friendly format. ");
MGCAddSnippet(75, "In some cases, selecting a complex set of Runnables to execute requires more planning and can be easy to construct if spread across several vrun commands. In order to create such a complex selection list, the user can add Runnables to and/or prune Runnables from a cumulative runlist before sending the selected Runnables off for execution.");
MGCAddSnippet(76, "By default, when the user specifies a set of Runnables via the -include, -exclude, and -select options or via bareword arguments, VRM builds an execution graph from the selected Runnables and executes the resulting actions");
MGCAddSnippet(77, "Parameters in the RMDB file can be used to select from among one or more options, using conditional and repetitive attributes on the Runnables that make up the regression suite.");
MGCAddSnippet(78, "String parameters are the easiest. The accept attribute takes the form: str(re), where re is a Tcl format regular expression. If re is the empty string, then any number of characters of any kind are accepted with no limit (except a  newline  character cannot be entered directly).");
MGCAddSnippet(79, "A numeric parameter is assumed to be a single integer number. The accept attribute specifies minimum and maximum values for the number specified by the parameter in the form: num(min, max). ");
MGCAddSnippet(80, "An enumerated parameter allows the user to be presented with a list of possible selections from a list of tests where all tests are run by default but the user can pass the -ask command-line option to vrun, and be allowed to choose a subset of tests for any given regression run.");
MGCAddSnippet(81, "The user is prompted for a value for a given parameters only if the parameter in question contains an ask attribute and the -ask command-line option is specified. The prompt for a given parameter is emitted when a reference to that parameter is first used in an Action script, another parameter definition, or anywhere a parameter reference can be used. This means that no prompt is issued for a parameter that is never used. It also means that parameters that must be expanded to resolve the expansion graph is prompted for before the regression run physically starts. Other parameters can be prompted after the regression run has started.");
MGCAddSnippet(82, "The following examples illustrate the suggested use model for these features.");
MGCAddSnippet(83, "Assume that when the user first starts to use the given RMDB file, the user has no idea what exists inside. A quick check of the top-level Runnables:");
MGCAddSnippet(84, "This example takes the four parameters, annotated with ask parameters, and then runs through a typical vrun initialization process. Following is the annotated RMDB fragment:");
MGCAddSnippet(85, "This functionality supports both automated status messages sent at the end of a regression run and ad-hoc messages initiated from user-definable TCL procedures at any point during the regression run.");
MGCAddSnippet(86, "You can generate an email in one of two use models, either an automated status message or one that is manually generated.");
MGCAddSnippet(87, "The settings for an email message are compiled from a combination of default settings, RMDB parameters, and arguments passed to certain TCL utility procedures.");
MGCAddSnippet(88, "Use the SendEmailMessage utility procedure, which uses the standard Simple Mail Transport Protocol (SMTP) to compose and send an email message to one or more recipients. you pass the procedure a list of key-value pairs which override the built-in defaults. ");
MGCAddSnippet(89, "You can compose an email from various sources through the use settings and utility procedures.");
MGCAddSnippet(90, "Use the vrun -modify command line to modify select parameters and attributes of a regression run after the regression has started.");
MGCAddSnippet(91, "You can modify select parameters and attributes during an active regression run.");
MGCAddSnippet(92, "Use the vrun -modify command line to modify an active regression run.");
MGCAddSnippet(93, "VRM supports -g (parameter default) and -G (parameter override) options. These options have the same syntax and similar behavior to options of the same name in Questa vsim. The exact syntax of these options is as follows:");
MGCAddSnippet(94, "Both the -g and -G options are composed of the following components (the -G option is used in this example but the same pattern and rules apply to the -g option):");
MGCAddSnippet(95, "As a result of base and group inheritance, the visibility of any given VRM parameter is not limited to a specific place in the topology like Verilog parameters. A single parameter definition can effect a significant chunk of database geography depending on where in the database it is defined. ");
MGCAddSnippet(96, "The -apicmd option can be used to issue a command to the database (RMDB) API. If this option appears on the command line, all options and arguments following it are consumed as part of the API command.");
MGCAddSnippet(97, "This chapter describes the VRM graphical user interface. ");
MGCAddSnippet(98, "Invoke Questa SIM Verification Run Manager in GUI mode by typing the following: ");
MGCAddSnippet(99, "When a VRM GUI session first opens, assuming a regression run is not also being launched by the same vrun command, the only window initially visible is the VRM Cockpit window. This window displays the contents of the currently loaded project file, including the RMDB files in use by the project and the pre-canned configurations attached to each RMDB file. This window also supports the creation of new configurations, the importation of regression run history from one or more VRM Data directories, the launching of new regression runs, and the opening of a VRM Results window for viewing the results of previously launched regression runs.");
MGCAddSnippet(100, "In order to define pre-canned configurations, it is necessary to reference at least one RMDB file in the project file. ");
MGCAddSnippet(101, "A named configuration is a collection of selected Runnables and command-line options. It is essentially a user-named template encapsulating a specific batch-mode vrun command.");
MGCAddSnippet(102, "This section describes the contents of the dialog box used to set up configurations in the VRM Cockpit window. This dialog box may have different names depending on how you arrive at it, including:");
MGCAddSnippet(103, "You can use the Edit VRM Configuration dialog box to make one-time edits to the runnable selections and/or command-line options before launching a regression run by using the menu items under VRM CockpitRun Special. ");
MGCAddSnippet(104, "This section defines the contents of the Edit VRM Configuration dialog box.");
MGCAddSnippet(105, "Sometimes a user has an existing VRM Data directory that was created by a regression run launched without a GUI configuration (as would be the case for nightly regressions initiated by a cron script). The current implementation makes no direct provision for inspecting VRM Data directories that are not associated with a configuration, but the obvious workaround is to create a dummy configuration and set the VRM Data directory to point to the directory being used by the non-GUI regression runs. The directory then appears under the dummy configuration and, under that, the historical Status Event Logs from that VRM Data directory are visible.");
MGCAddSnippet(106, "Following are the ways to initiate a new regression run from the VRM GUI:");
MGCAddSnippet(107, "In order to view the results of a regression that was previously launched, it is necessary to find the Status Event Log entry representing that regression run in the VRM Cockpit. The Status Event Log entry for any given regression run is under the History row, which is under the VRM Data directory in which the regression run was executed. The VRM Data directory row is under one of the configuration entries.");
MGCAddSnippet(108, "As each regression completes, its resulting status is loaded into a database for future analysis. This history can be viewed by selecting one of the configuration entries in the VRM Cockpit window and then select the VRM CockpitView History menu item.");
MGCAddSnippet(109, "In any single VRM GUI session, there is only a single VRM Cockpit window. However, there may be any number of VRM Results windows. Each VRM Results window is generally associated with a single regression run (regardless of whether said regression run is currently ongoing or has already completed). If the regression with which a given VRM Results window is associated is rerun from the context menu of the VRM Results window itself, the same VRM Results window may be  re-purposed  to monitor the newly launched regression run. If a regression run is launched by any other means, or if a historical regression run is opened, a new VRM Results window is invoked. A VRM Results window may be closed and/or minimized as the user wishes.");
MGCAddSnippet(110, "There are other VRM GUI functions that can be invoked from the VRM Results window. In general, these functions are associated with a particular Action which means one or more Action rows must be selected prior to using the context-menu to invoke the particular function. The list of functions supported includes the following: ");
MGCAddSnippet(111, "The VRM Results window provides an interface for filtering results based on pre-defined or user-generated filters.");
MGCAddSnippet(112, "Control the information that appears in the VRM Results window based on the following configuration tasks you can perform related to filters in the VRM Results Window.");
MGCAddSnippet(113, "Control the information that appears in the VRM Results window based by applying a pre-existing or user-created filter through the following steps.");
MGCAddSnippet(114, "Portal for configuring and applying filters for the VRM Results window");
MGCAddSnippet(115, "Dialog box used for building filter expressions.");
MGCAddSnippet(116, "The VRM Results - VRMDATA (history) window is a slightly modified version of the VRM Results window. ");
MGCAddSnippet(117, "The VRM Project file is made up of one or more configurations, each of which is associated with a specific RMDB file. Each configuration contains data to be used for regression runs that are launched via that configuration. This data includes a pointer to the VRM Data directory to be used for the regression results, the pattern of included/excluded Runnables to be executed, and the vrun command-line options to be used for the batch-mode regression run. Whenever a configuration is added, deleted, or edited, the new configuration data is saved to the VRM Project file. There is no limitation on how many project files a user may define or where they may be stored. However, only one project file can be loaded into a single VRM GUI session at any one time. ");
MGCAddSnippet(118, "The most common use model for launching a regression run is to use the VRM Cockpit context-menu to select Run on a configuration or Run Again on a history mode, or to use the VRM Results context-menu to invoke Run Again on the regression represented by that window. In this case, the status of the new regression is monitored via a new VRM Results window and the log output of the resulting batch-mode regression is not displayed in the Transcript window (the log output is captured in a file and may be viewed as a file upon request).");
MGCAddSnippet(119, "Users migrating from previous versions of the VRM GUI or from an entirely batch-mode flow may want to use the GUI to track the progress of a single regression run without having to set up a Project file with a single configuration. To accommodate those users while providing a smooth transition path to the Project file use model, the VRM GUI supports a  legacy mode  at start-up.");
MGCAddSnippet(120, "The batch-mode vrun application supports a toprunnables attribute in the rmdb element of the RMDB file. In batch-mode, this attribute is used if no other Runnables are selected for execution on the vrun command line. In other words, this attribute lists one or more Runnables that are considered selected unless the vrun command line selects an alternate set of Runnables. This allows vrun to be used like the make command (typing just the command vrun at the shell prompt to initiate a regression run).");
MGCAddSnippet(121, "A VRM Data directory provides a structured area within the file system where the Actions that make up a regression run can be launched concurrently without the possibility of file collisions. Subdirectories are created under the VRM Data directory based on the hierarchical topology of the regression suite. Every regression run that is launched in a given VRM Data directory is logged in the logs directory under the top-level VRM Data directory. This is true regardless of whether the regression run is launched from within a GUI session, manually at a shell prompt, or by an automated process such as cron.");
MGCAddSnippet(122, "The next several sections describe the menus used to initiate operations in GUI mode. To review general terminology, every window type in Questa has an  active window menu  that shows up in the menu bar of the main window whenever an instance of that window type is activated. ");
MGCAddSnippet(123, "The VRM GUI application main menu, the VRM Cockpit undocked and context menus, and the VRM Results undocked and context menus share much of their functionality. The following sections describe groups of menu items, in no particular order. Following the menu item descriptions is a  map  of the contents of the primary VRM menus in outline format.");
MGCAddSnippet(124, "The GUI menu times provide control over VRM projects.");
MGCAddSnippet(125, "The following menu items are found in the active window/context menu of the VRM Cockpit window. ");
MGCAddSnippet(126, "The following menu items are found in the Edit menu of the main window menu bar, in the Edit menu of the undocked VRM Cockpit window, in the Edit menu of the undocked VRM Results window, and in the active window/context menus the VRM Cockpit window. ");
MGCAddSnippet(127, "The following menu items are found in the Run menu of the undocked VRM Cockpit window and VRM Results window and in the active window/context menus of the same two windows. The behavior differs based on what has been selected. If a Run Configuration row is selected in the VRM Cockpit window, a regression run is launched based on the command-line options and Runnable selections stored in the selected configuration. If a regression run History line is selected in the VRM Cockpit window, a regression run is launched based on the command-line options and Runnable selections in effect when the selected regression run is executed.");
MGCAddSnippet(128, "The following menu items are found in the active window/context menu of the VRM Cockpit window.");
