MGCAddSnippet(133, "These start-up procedures will get you up and running quickly.");
MGCAddSnippet(134, "The most common way a new user would migrate from batch-mode use (or from 10.0 use) to 10.1 GUI-based use is to append the -gui command-line option onto an existing batch-mode command. For example,");
MGCAddSnippet(135, "When a user first starts out with the VRM GUI, most likely the user does not have a project file.");
MGCAddSnippet(136, "As mentioned above, any time a batch-mode regression is launched at the same time that a GUI session is launched, a configuration corresponding to the command-line options used to launch the batch-mode regression is added to the VRM Cockpit. ");
MGCAddSnippet(137, "This section describes generating a configuration by invoking vrun at the Transcript window prompt with a blank project file.");
MGCAddSnippet(138, "Set up your environment to open text files in an external editor.");
MGCAddSnippet(139, "This section explains how to start new or view previous regression runs.");
MGCAddSnippet(140, "To launch a new regression run based on a configuration stored in the currently loaded project file, the user does the following: ");
MGCAddSnippet(141, "The child entries listed under the History row for a given configuration (found under the single VRM Data row under the configuration itself) represent the various Status Event Logs generated by regression runs executed in that particular VRMData directory. The Status Event Logs each contain a complete record of a single batch-mode regression run. The timestamp listed in the Name column for that Status Event Log row shows the date and time at which the batch-mode regression run began (the batch-mode vrun process ensures this timestamp is unique for each regression run). The status of a given regression run may be viewed using the following steps:");
MGCAddSnippet(142, "Each Status Event Log contains enough information to rerun the associated regression run in exactly the same manner as when the Status Event Log was generated. To re-execute a given regression run, do the following: ");
MGCAddSnippet(143, "A given regression run may be re-executed from the VRM Results window in which the results of the original regression run are currently being viewed, whether the VRM Results window was opened as a result of the original run or as a result of viewing the results of a previous run. The Run Again... context-menu item re-executes the regression run exactly as it was executed before, while the VRM CockpitRun SpecialOne-time Edit and Run Again allows the user to modify the Runnable selection and/or command-line options for this one regression run only (as described in the sections above). The difference between re-executing a regression run from the VRM Results window and re-executing it from the VRM Cockpit window is that a re-execution from the VRM Results window reuses the existing VRM Results as is, thus overlaying the results of the new regression run onto the results from the original run.");
MGCAddSnippet(144, "A batch-mode regression may be launched manually from within a GUI session by typing the vrun command and any appropriate command-line arguments (except for the -gui option) into the Transcript window at the prompt.");
MGCAddSnippet(145, "If in a given environment, one or more batch-mode regression runs has been launched outside of the GUI environment, the results stored in the VRM Data directory can be imported into the VRM Cockpit (and, thus, into the current project file, if one is loaded) by doing the following:");
MGCAddSnippet(146, "Each configuration points to a single VRM Data directory and this directory is where the VRM Cockpit searches for the results of previous regression runs. In most cases, when a new configuration is added to the project file, a new (and unique) directory is chosen to serve as the VRM Data directory for regression runs launched via that configuration. If the new configuration is configured to use an existing VRM Data directory, the History of that configuration is read from that VRM Data directory, regardless of whether the previous regression runs were launched from the GUI or manually by the user (or by a periodic batch-mode regression script). ");
MGCAddSnippet(147, "Assume a configuration exists that points to a given VRM Data directory. Assume also that several regression runs have been launched from this configuration and the Status Event Logs are stored in the same VRM Data directory. Finally, assume the change of VRM Data directory associated with this configuration by doing the following steps:");
MGCAddSnippet(148, "The VRM GUI does not enforce a one-regression-run-per-configuration rule, nor does it enforce a one-to-one correspondence between configurations and VRM Data directories. Instead, each batch-mode regression establishes an advisory lock on the VRM Data directory prior to launching any Actions (this occurs for regression runs launched from the GUI and for regression runs launched manually from outside any GUI session). In the case where a batch-mode regression detects an active lock on the VRMData directory, a message is emitted to the output of the vrun process and the process waits 30 seconds before launching any Actions to give the user time to abort the process if the overlap was unintentional.");
MGCAddSnippet(149, "Status Event Logs and collateral files under a VRMData directory can be deleted in the following manner: ");
MGCAddSnippet(150, "This section explains how current results inform future testing.");
MGCAddSnippet(151, "Typically, the user defines a configuration in which all the active tests in the regression suite are selected and the command-line options are chosen for optimum performance. It is likely the run is setup to automatically rerun failed tests with a debug parameter set to gather additional information to help assess the cause of the failure. One such tool is called Results Analysis. Assume the RMDB is setup to add the messages from every failed test into the triage database (TDB) file. ");
MGCAddSnippet(152, "Once the regression has completed, the user selects a failing test in the VRM Results window and uses the context menu to select FileOpenResults Analysis Database to open the TDB file for that regression in the Verification Results Analysis window. This window shows all the messages generated by the failing tests. After selecting one or more errors and fixing them in the design, the user selects those error messages in the Results Analysis window and uses the Run Again context menu item to rerun the tests associated with those messages. This sub-menu opens to show a list of configurations available in the VRM Cockpit window. Typically, the user defines a configuration called  rerun tests  in which the  Clear merge file before auto-merge  and  Clear TDB before auto-triage  check boxes are unchecked. This ensures that the merge file and TDB are not overwritten by the regression rerun. From the Results Analysis window  Rerun in Run Manager >  sub-menu, the user clicks the  rerun tests  configuration to rerun the tests associated with the selected messages using the modified command-line options.");
MGCAddSnippet(153, "You can manipulate the names and contents of the VRM Cockpit columns and the counters in the status bar of the VRM Results window.");
MGCAddSnippet(154, "Modify the counter configuration of the VRM Cockpit columns or VRM Results window status bar by using the vrmcounter commands and altering a configuration file.");
MGCAddSnippet(155, "The configuration file used with the vrmcounter commands contains mapping information that identifies the counter names and the related status keywords that contribute to the counter.");
MGCAddSnippet(156, "The batch-mode vrun application understands projects and configurations. If the -project command-line option points to a valid VRM Project file and the -config command-line option matches the name of a configuration inside that project file, then the batch-mode regression process uses the Runnable selections and command-line options specified by that project to run the regression. Any additional command-line options listed on the original vrun command line will override command-line options specified in the configuration.");
MGCAddSnippet(157, "Under VRM, a batch-mode regression run is launched with the vrun command. This command generally selects one or more Runnables from an RMDB file and causes them to be executed according to a set of command-line arguments provided by the user. For example, the following command: ");
MGCAddSnippet(158, "Prior to the Questa Verification Run Manager 10.1 release, the command-line option used to specify the RMDB file was -config as opposed to -rmdb. For back-compatibility purposes, the  -config command-line option can still be used to specify the RMDB file but only if the -project command-line option is not present on the command line. In that case, vrun assumes the  -config was meant to specify the RMDB file but a deprecation warning will appear in the vrun output. If the -config command-line option is used in conjunction with the -project command-line option, the vrun process assumes the value of the -config option was meant to specify the name of a particular configuration in the specified project file.");
MGCAddSnippet(159, "The following is not a VRM function but can be useful for users just starting out with VRM. A VRM database can be generated from one or more existing UCDB, Merge, or Rank files. This database generation function is only available from the Questa GUI.");
MGCAddSnippet(160, "In order for the tests to run as is under VRM, a  cd  command (to the directory stored in RUNCWD for that test) is added to each Action script in order to run each simulation in the directory in which it was initially launched. In order to prevent file collisions between concurrent simulations, the sequential flag on the all Group is set to  yes , meaning VRM will run each simulation one-by-one rather than concurrently.");
MGCAddSnippet(161, "The UCDB files do not contain information regarding either compilation or post-processing steps. The compilation command(s) can be added to the preScript Action script under the all Group Runnable. If the execScript Action scripts have been modified to support concurrent execution, it might be a good idea to add a vopt command to the preScript Action. This will cause the design database to be optimized once before any of the simulations are launched. Without this, the first simulation to be launched starts an optimization step and the other simulations (launched at the same time) will complain that the work library is locked. Pre-optimizing avoids these messages.");
MGCAddSnippet(162, "The Regression Author is a web-based interface that allows you to easily create a simple RMDB file for your VRM-based regressions.");
MGCAddSnippet(163, "You can use the web-based VRM Regresssion Author interface to create RMDB files for your VRM-based regression runs.");
MGCAddSnippet(164, "Use this task to start a Regression Author server to connect to from a different machine.");
MGCAddSnippet(165, "Use this task to start a Regression Author server that also invokes a web browser on the same machine.");
MGCAddSnippet(166, "Starts the VRM Regression Author environment.");
MGCAddSnippet(167, "Introduction to the web interface of the Regression Author.");
MGCAddSnippet(168, "The RMDB database contains the information required to expand one or more selected Tasks or Groups of tasks, invoked by name on the command line, into one or more individual Actions that are to be executed. ");
MGCAddSnippet(169, "The RMDB database design is based on the following requirements:");
MGCAddSnippet(170, "The RMDB database contains user-supplied content. For the most part, this content follows common-sense guidelines. For example, the content of commands provided in the database must conform to the syntax of the script language in which it is written. This section outlines the exceptions to the obvious guidelines.");
MGCAddSnippet(171, "One of the requirements of the XML format is that there be a single  root  XML element that contains the entire contents of the XML file. In the case of an RMDB file, that element is the rmdb element that essentially defines and contains the entire database. This rmdb element is also called the  document element  in XML terminology, since that single element and its contents form the entire definition of the  document  represented by the XML file (the XML format was originally designed to represent document markup, similar to HTML).");
MGCAddSnippet(172, "VRM views the entire regression suite as a tree whose leaf-level nodes represent individual Tasks to be executed. Non-leaf nodes, known as Groups, can contain zero or more leaf-level Tasks or other Groups as members. The depth to which Groups can be nested is unlimited. This hierarchical relationship is a virtual one, reflected only in the membership lists of the Group nodes. In the database itself, the Group and Task definitions are stored as a flat list of named and typed runnable elements that share a single namespace.");
MGCAddSnippet(173, "The method element is used to define an execution method for Action scripts. An execution method is essentially a single shell command that is used to launch the job corresponding to a given Action script.");
MGCAddSnippet(174, "The usertcl element is used to define custom implementations for one or more of the user-definable procedures. ");
MGCAddSnippet(175, "This section illustrates the VRM execution model as it relates to sequential and non-sequential Group Runnables.");
MGCAddSnippet(176, "There are three kinds of Actions defined in the database: preScript, execScript, and postScript. A leaf-level Task can define an execScript that contains the commands necessary to carry out the Task in question. A Group can define a preScript and/or a postScript. The preScript consists of the commands that are run prior to invoking the Tasks and/or Groups listed as members in the Group in question. The postScript consists of the commands that are run after all the Tasks and/or Groups contained in said Group have completed. Each of these Actions is associated with a script defined in the RMDB database. Each script is made up of zero or more commands. If an Action script is not defined for a particular Test or Group, or if the Action script contains no commands, then the Action is skipped and nothing is executed at that stage in the run.");
MGCAddSnippet(177, "In some cases, such as when constrained random techniques are used to generate stimulus for the device under test (DUT), it can be useful to be able to repeat a single Task (that is, simulation) or Group of Tasks multiple times as part of the same regression run. ");
MGCAddSnippet(178, "The repeat-count expansion occurs when the list of selected Runnables is constructed.");
MGCAddSnippet(179, "Unless otherwise specified, the indices of the repeating Runnables run from one (1) to the number given in the repeat attribute (N). The list of indices can be controlled by the foreach attribute. The foreach attribute contains a list of one or more string tokens, separated by whitespace, commas, or a combination of both. A Runnable containing a properly formatted foreach attribute (one whose value contains at least one token) repeats once for each token in the value of the foreach attribute, irrespective of whether there is a repeat attribute specified. The indices used for each instance of the Runnable are derived from the token strings found in the foreach attribute.");
MGCAddSnippet(180, "The testlist attribute specifies a path, relative to the directory from which the RMDB is read, to a Testlist File, which enables the generation of random tests. ");
MGCAddSnippet(181, "VRM supports repeating an Action (that is, test, and so on) or a group of Actions multiple times from a single runnable definition. There are two mechanisms to accomplish this as follows:");
MGCAddSnippet(182, "For runtime-controlled repeat loops, the iteration values are referred to as seeds, since seeds is the most common use for this functionality. However, nothing related to this functionality is tied to seed management, specifically; the same functionality can be used to dynamically iterate configurations, run-time options, test names, or any other user-configurable setting that can be reduced to a list of tokens passed to the foreach attribute of the runnable element with which they are associated.");
MGCAddSnippet(183, "When a user wants a given Runnable to repeat with specific seeds (as opposed to a simple integer counter), the user attaches a list of the seeds to the runnable element via the foreach attribute as follows: ");
MGCAddSnippet(184, "Once vrun detects one or more * tokens in the foreach attribute of a given runnable element, it assumes that the * token is a stand-in for one or more real seeds that is read and/or generated by a user-supplied TCL code as the regression progresses. In order to fetch these seeds, a user-definable procedure, called GetNextIteration, is passed the usual userdata array containing data variables relevant to the context in which the Runnable instance in question is executed. The GetNextIteration procedure, in response, returns one or more tokens separated by spaces and/or commas, which are used as the iteration tokens for the next repeating iteration. Each token must meet the same criteria applied to tokens supplied directly via the foreach attribute (see the next section for details).");
MGCAddSnippet(185, "The value of the foreach attribute must conform to the following pattern: ");
MGCAddSnippet(186, "The GetNextIteration procedure, like all other user-definable procedures, is passed a reference to a TCL array containing various context-specific data items");
MGCAddSnippet(187, "The primary purpose is to provide a way to run one or more Actions until some arbitrary limit is reached when that limit may not be known until run-time (for example, running tests until a given level of coverage is reached). ");
MGCAddSnippet(188, "This is an example of how this functionality can be used. The assumption is that the design has a number of different configuration and/or mode settings, each of which has several possible settings such that it is not possible to simulate every combination in one overnight regression run. The basic premise of the solution is that the user can simulate some random number of these configurations each evening, as time allows, and that over time a significant number of the possible combinations are covered.");
MGCAddSnippet(189, "It is possible to prevent the execution of a specified Runnable based on an attribute that can be parameterized. If the if or unless attributes are specified in a runnable element, that Runnable's membership in a Group can be disabled based on the value of either attribute. This might be useful if a particular Group contains some Tasks that are only applicable in certain modes or when run under certain conditions.");
MGCAddSnippet(190, "The generic VRM use model is relatively simple. The user defines a regression suite containing an arbitrary number of tests. For convenience, these tests can be collected into groups, where each group can perform some action before and after the group's members are executed. The complete regression suite hierarchy is encoded into a RMDB database. A single call to VRM can then be used to execute all or part of the regression suite under specific conditions. Because VRM is expected to work under various existing regression flows, there are many opportunities for customizing and/or parameterization.");
MGCAddSnippet(191, "This section describes the Run and Rerun algorithms.");
MGCAddSnippet(192, "A user-definable procedure, RegressionStarting, is called immediately before VRM begins to launch Action scripts. Another user-definable procedure, RegressionCompleted, is called after the  done  message for the last Action to be executed has been received (actually, the RegressionCompleted procedure is called when the vrun application determines, as a result of the processing of the final  done  message, that there are no more Actions eligible to run and none currently running).");
MGCAddSnippet(193, "VRM allows a single rerun to be performed on selected Actions. The -rerun option is given a new set of options, at least one of which must select one or more Runnables for the rerun phase, and used the options supplied to rerun a subset of the Actions launched on the first pass. ");
MGCAddSnippet(194, "The VRM algorithm can be divided into two basic functions. The first, somewhat trivial function is to build a list of Actions that need to be executed. This happens once when VRM is first executed. The second, more complex function is to listen for job completions and kick off subsequent rounds of Actions as they become eligible to run. This second function is mainly triggered in response to a  done  message being received from an existing job (exceptions are made for the initial round of eligible Actions that are triggered by a synthetic  done  message on the pseudo-Action =init= and for timeouts, which are handled as if a  done  message had occurred but in response to the lapse of a preset time interval).");
MGCAddSnippet(195, "This section describes how you can create your regression suite such that you can track actions by test name, rather than action strings.");
MGCAddSnippet(196, "This section describes several restrictions to test-centric regression suites, due to the fact that test-centric control is not native to the VRM workflow.");
MGCAddSnippet(197, "Status reports generated with the vrun -status command will default to the mode, test-centric or action-centric, used for the regression run being reported on.");
MGCAddSnippet(198, "This task describes how you define test names in your RMDB file.");
MGCAddSnippet(199, "By default, the vrun command analyzes the specified RMDB file and will enable the action-centric functionality. However, you can manually force the command into test-centric mode by following this procedure.");
MGCAddSnippet(200, "While your regression suite is running, you can perform three control operations (suspend, resume, or terminate) on an execScript action associated with a task runnable.");
MGCAddSnippet(201, "At the highest level, VRM takes one or more regression suite names given on the command line, expands them (using information in the RMDB database) into a list of Actions that must be executed in some sequence, executes each Action in turn, and then reports the outcome of the entire regression run. The sequence in which the Actions are executed depends on their grouping in the RMDB database. In order to discern the proper execution sequence, the selected Runnables are expanded into Actions using a directed acyclic graph (referred to as the  execution graph ). The nodes of the graph represent Actions (that is, preScript, execScript, and postScript) to be executed. The vertices of the graph encode the dependencies between these Actions (that is, a postScript Action depends on the completion of the various execScript Actions required for the members of the group to which it belongs).");
MGCAddSnippet(202, "When VRM is invoked, the user specifies one or more Runnable names on the command line. The RMDB database entry for each of these Runnable names is retrieved from the database and one of the following actions takes place:");
MGCAddSnippet(203, "This section illustrates how individual Tasks and Groups may be grouped together:");
MGCAddSnippet(204, "In general, VRM assumes that the Runnables listed as members under a given Group are unique (that is, no single Runnable is listed twice in the membership list of any single Group). This restriction is enforced when vrun builds the execution graph. The handling depends on whether the Group in question is sequential or non-sequential.");
MGCAddSnippet(205, "Some Action nodes are marked for special handling in the event of failure. A failure can be detected by a non-zero return status from the user script for that Action, or it can be the result of the post-execution pass/fail analysis performed after a simulation. In either case, a failure can (depending on the circumstances) cause other Actions in the execution graph to be skipped.");
MGCAddSnippet(206, "You can pass codes to the controlling vrun process of an action script by adding the following Questa command/argument set:");
MGCAddSnippet(207, "Each Runnable definition (that is, each runnable element) can include a list of zero or more parameter element definitions. A parameter is nothing more than a name/value pair that allows multiple Tasks to share the same execution script (or multiple Groups to share the same Task) by providing unique per-Group or per-Task values to be used in the scripts. ");
MGCAddSnippet(208, "A small number of parameters are predefined with values equal to certain global paths or names relevant to VRM algorithm. ");
MGCAddSnippet(209, "By default, parameter values are used as is, exactly as they appear in the parameter definition (after external entities (like >) are converted back to the characters they represent). It is possible to define a parameter value as a TCL expression that undergoes the usual variable/command substitution within the TCL interpreter each time the parameter is expanded. Note that this is TCL substitution, not evaluation. In order to execute TCL code as part of the parameter expansion, the code needs to be defined as a procedure and command substitution used to execute the procedure.");
MGCAddSnippet(210, "One often needs to refer to source files (external scripts, HDL source, vsim do files, and so on) as part of a complete regression run. One of the best places to store these source files is in the same directory as, or a subdirectory of, the directory from which the RMDB file is read. The reason is that the user can refer to the RMDB file in the -rmdb command-line option from any directory and the relevant source files references are still correct (one can solve the problem by using absolute paths as well, but the use of absolute paths can cause additional problems if the source files are ever moved to some other directory in the file system).");
MGCAddSnippet(211, "The examples in this section are complete and will run as is under VRM; however, they are too simple to be real  examples  on their own. In any event, use the code herein and add to it when appropriate.");
MGCAddSnippet(212, "When considering the configuration of most regression suites, there is usually some degree of repetition. If, for example, 100 tests all require the same simulation commands with some minor variation, it would be a poor system that forced the user to specify the redundant information 100 times, once per test.");
MGCAddSnippet(213, "The following shows an example of base/group inheritance in the context of parameter expansion. ");
MGCAddSnippet(214, "From the point of view of base inheritance, all Runnable nodes are equivalent. A Group can refer to a Task as a base Runnable or vice-versa (since base inheritance is concerned only with content, not behavior). Data defined in the base Runnable is treated as if it is defined in the referring Runnable itself. While there is nothing preventing a base Runnable from participating in the execution graph of the regression suite, it is more common for Runnables used as a base for other Runnables to not be involved in the execution graph themselves. In such cases, it can be desirable to enforce this non-involvement so as to prevent inadvertent cycles in the graph. To mark a Runnable as non-participatory, set the value of the type attribute to base instead of task or group. If a base type Runnable is included in the membership list of a Group, then VRM outputs an error and ignore the base type Runnable. Note that this is similar to the  pure virtual base class  concept in C++ (a base that cannot, by itself, be instanced).");
MGCAddSnippet(215, "There is, of course, no reason to expect that there would be only one definition for any given parameter, or that the parameter in question is defined in the same Runnable from which it is referenced. VRM parameters (and other element content) can be inherited from other Runnables. There is a priority order (that is, search order) used to determine the best definition to use in expanding a given parameter on behalf of a parameter reference found in a given Runnable. These rules are outlined below.");
MGCAddSnippet(216, "For any given element, a content element (for example, a parameter or Action script, in the case of a Runnable) is resolved as follows:");
MGCAddSnippet(217, "The following points form the complete set of rules by which parameter references are expanded. ");
MGCAddSnippet(218, "One requirement of most regression environments is the ability to run one or more tests in  debug mode  either early in the design process or in response to failures exposed in the nightly run. Assume that enabling debug in your regression suite requires the use of additional options on both the compile command line and the simulation command line. Assume that you can define the compile command options as a parameter called cmpopts and the simulation command options as a parameter called simopts. There are at least two ways in which these options can be applied to the regression suite.");
MGCAddSnippet(219, "In some cases, especially where an existing do file or shell script is used in conjunction with VRM, an Action script can make use of the value of a parameter as an environment variable. The most obvious way to do this is to add commands to the script (or to a wrapper around the script) that explicitly set environment variables based on parameter values.");
MGCAddSnippet(220, "In order to prevent multiple Actions (that is, user scripts) from a single vrun invocation from overwriting or otherwise interfering with each other, each Action executed by VRM is launched from within a working directory unique to the Runnable on whose behalf the Action is launched. In order to prevent multiple invocations of VRM (by other users or by the same user) from interfering with each other, the root of the scratch hierarchy within which these per-Runnable directories are created is control by the user.");
MGCAddSnippet(221, "For any given regression run, each Task or Group of Tasks is assigned a unique working directory and the working directories for the member Groups and/or Tasks within any given Group are created directly under that Group's working directory in a manner reflecting the membership hierarchy defined by the RMDB database. This allows the user scripts to refer to files maintained on behalf of their parent Group (that is, the coverage merge file or design library) via relative path names such as  ..  (although that does not preclude the user from passing that information via parameters defined at the Group level). Any files generated by VRM in association with a given Action (that is, Action script files, .do files, log files, and so on) are written to the working directory associated with the Runnable on whose behalf the Action is executed.");
MGCAddSnippet(222, "A Runnable can define one or more local files that are generated, copied, or linked into the working directory prior to the execution of any Action scripts in that directory. Each local file to be generated into the working directory is designated by a corresponding localfile element contained within the runnable element with which it is associated. An optional src attribute specifies the file or directory from which the contents of the local file are to be taken. If the src attribute is not specified, then the contents of the localfile element itself are used to generate the local file.");
MGCAddSnippet(223, "Following are some examples of the localfile element in various configurations (assume (%RMDBDIR%)/srcdir is a directory):");
MGCAddSnippet(224, "Each Task or Group of Tasks must define what is meant by  test collateral.  That is, what files must be saved in order to do post-analysis even after the working store has been deleted. ");
MGCAddSnippet(225, "When a file or directory is created or written to by vrun, a check is made to ensure that the file falls into one of two subtrees on the file system as follows:");
MGCAddSnippet(226, "Once the RMDB database has been read and the requested Runnables have been expanded to form the execution graph, a completion event is posted to the special =init= Action. This causes one or more Actions to become eligible for execution (that is, their dependencies having been completed). The Actions directly dependent on the =init= Action are generally the preScript Actions of the top-most Group(s) selected via the command line. Actions that are eligible for execution are added to a run queue. An inner loop periodically removes Actions from this queue and executes them. A list of currently executing Actions is also maintained, in which the expected completion time (execution time plus the minimum timeout value for that Action) is recorded. As each Action reports completion, it is removed from the currently executing list and from the graph. The vertices of the graph beginning at the completed node are followed to determine what Actions, if any, can be eligible to run next. If a vertex from the completed Action happens to be the last such vertex into the node at the opposite end, that opposite-end node also becomes eligible to run and is added to the eligible Action run queue.");
MGCAddSnippet(227, "Each Action (preScript, execScript, or postScript) is defined either in terms of a sequence of one or more commands stored in the RMDB database or as a pointer to an existing script file (said pointer also being stored in the RMDB database). ");
MGCAddSnippet(228, "The command sequence used in the wrapper for vsim launched commands is shown below.");
MGCAddSnippet(229, "The command sequence used in the wrapper for non-vsim (shell) commands is shown below.");
MGCAddSnippet(230, "The Action scripts (preScript, execScript, and postScript) are parsed for parameter expansion and copied to the working directory. This includes scripts defined in the RMDB database and scripts pointed to by the file attribute of the script element. If pre-existing (user-defined) scripts are to be used to drive the behavior of the regression, then there are the following three ways in which the parameterizable information can be passed:");
MGCAddSnippet(231, "In this case, a single command is used in the Action script. This command refers to the pre-existing script and passes the appropriate arguments on the command line. If the pre-existing script (myscript.csh) looks something like the following:");
MGCAddSnippet(232, "In this case, a mini-wrapper script is defined as the Action script. This mini-wrapper sets a series of environment variables based on the relevant parameterized values and those variables are accessed from within the pre-existing script. If the pre-existing script (myscript.csh) looks something like the following:");
MGCAddSnippet(233, "The two examples above assume that the pre-existing script exists in a subdirectory of the directory from which vrun was launched. The pre-existing script is executed from that location by the Action script. However, one of the key reasons for copying the parameter-expanded Action script into the working directory is so the tests can be rerun manually under the same conditions as those under which they were run by VRM. If the pre-existing script is not present in the working directory, then some of that advantage is lost (or, at the very least, the user needs to make sure the pre-existing scripts remained accessible from their original paths).");
MGCAddSnippet(234, "In some cases, there can already be an existing directory structure within which existing user scripts are executed, assuming they can find various HDL source and setup files at fixed locations within said directory structure. In order for these sort of scripts to run as is under VRM, executing from a specific directory within the test directory tree, a cd command (pointing to the directory in which the script is to be run) can be added to each Action script. This causes the script to run subsequent commands (that is, those following the cd command itself) in the directory in which the script is launched without VRM. In order to prevent file collisions between concurrent simulations, the sequential flag on any Group Runnables accessing the fixed directory structure should be set to  yes , meaning VRM runs each Action script one-by-one rather than concurrently.");
MGCAddSnippet(235, "Each Action script has a return value that indicates, at a coarse level, whether the commands contained in the script encountered any errors. This return value is communicated to the launching vrun instance for use in pass/fail analysis. This function can require some cooperation from the (user's) Action script in order to correctly communicate the status of commands contained in the Action script.");
MGCAddSnippet(236, "A vsim mode script is executed via the do command in vsim, which does not return status. When an error occurs in a vsim TCL script, the interpreter executes the optional onerror handler. In order to trap errors and use them to modify the return status of the Action, the user must make use of the onerror handler. The wrapper script associated with the Action provides a procedure that can be called to set the return status and optional message string. The following example shows a preScript with the onerror handler set:");
MGCAddSnippet(237, "An exec mode Action script is executed from the wrapper script for the associated Action via the exec command in vish (TCL). When a command in the Action script returns a non-zero status, or when the Action script itself exits with a non-zero status, that status is made available to the TCL exec command and is returned to the wrapper script and communicated to the invoking vrun process via the  done  event. Provided all the commands in the script return POSIX-like status values, there is no need to alter the Action script. However, if the user wants the script to exit at the first error, or on some error from a 3rd-party utility that does not return a non-zero status, the exit command can be used (assuming Borne-shell or C-shell; other scripting languages can have a different exit command). The following example exits with an error if the contents of a log file do not match a file containing the expected results for the simulation:");
MGCAddSnippet(238, "One possible reason for VRM hanging is an Action script that falls into the vsim command-line prompt after completion. Action scripts launched in  exec-mode  (the launch attribute is set to something other than vsim) are especially susceptible because the -do option in vsim does not exit the application when all of the specified commands have been executed. Be sure to put a  quit -f  command at the end of the -do command list. For example,");
MGCAddSnippet(239, "By default, VRM launches scripts as background processes. Their only means of communicating errors back to the launching vrun process is the TCP/IP port on which the vrun process is listening. If the process simply fails to launch (for example, if the vsim or vish processes cannot be found), VRM will detect a launch error and treat the corresponding Action as it would any other failed job. If, however, the wrapper command launches as expected but fails to execute the wrapper script (for example, in the case of an error originating in a faulty method command), VRM could miss the error. In this case, the only recourse is a timeoutQ violation (that is, the timeout window between launching the Action and receiving the  start  message from the wrapper). By default, this delay is 31 seconds. It must be made longer in the case of a grid-based method command. After a timeout, the offending error condition will most likely be reported in the (xxx)Script.stderr file that is also echoed to the vrun log output.");
MGCAddSnippet(240, "On occasion a user s script needs to emit an error, warning, or informational message back to the executing vrun application for inclusion in the log output for that run. There are two ways to do this as follows:");
MGCAddSnippet(241, "Use the role attribute of an Action script to mimic the role of another element type.");
MGCAddSnippet(242, "When an Action is launched, VRM records the time by which the Action is expected to reach the next phase of execution. A background loop within vrun periodically checks for Actions that have not reached their next milestone in time. In this case, a  timeout  is declared and the Action is considered to have failed.");
MGCAddSnippet(243, "By default, the wrapper associated with each Action launched by VRM is executed by either vsim or vish as a child process of the initiating VRM process. The exact command used to launch this process depends on the value of the launch attribute of the element associated with the Action. For Actions whose launch attribute is set to vsim (or which do not have a launch attribute, since vsim is the default launch type), the following command is used:");
MGCAddSnippet(244, "Execution method (method) elements can appear within any Runnable (that is, as a child of a given runnable element). For each Action scheduled for execution, a search for an appropriate execution method is performed. This search follows the same rules as parameter expansion, following both the base and group inheritance chains starting from the Runnable on whose behalf the Action is being run (which, because of inheritance, may not be the same as the Runnable in which the Action script is defined). If no execution method is found for a given Action, then the Action is launched using the built-in default method described above.");
MGCAddSnippet(245, "Execution methods can specify a per-method minimum timeout by adding a mintimeout attribute onto the method element. The mintimeout attribute is read from the method element that actually supplied the command, even if the command is inherited from a base method element. In other words, even though the mintimeout attribute is actually attached to the method element, it is easier to think of it as being attached to the command element itself. For example, consider the following configuration elements:");
MGCAddSnippet(246, "By itself, the ability to add method elements to Runnables in order to affect subsets of the regression suite is useful but still somewhat inflexible. In many cases, there can be a legitimate reason for wanting to launch some Actions locally, some on specific machines (that is, large capacity machines), and some on server grids of various types. Compiles, for example, may need to be executed on the local machine (or on a specific remote machine) prior to launching any simulations. Simulations may need to run on a grid during overnight regressions but might also be run on the local machine for small interactive test runs during the day. Some simulations may need additional resources or may require a slightly different set of options when the job is queued. All of these things point to the need for a more flexible paradigm for specifying the command by which each Action script is launched.");
MGCAddSnippet(247, "One or more method elements can appear at the top-level of the RMDB file, as children of the document (rmdb) element and siblings of the runnable elements. These method elements cannot be used to satisfy an execution method search. They exist only as base methods to be referred to by other method elements. Any method elements referred to via the base inheritance chain is searched for by name at the top-level of the database. Since attributes are never inherited, the only use of base execution methods is to provide a common execution method command for multiple method elements defined within the various runnable elements. For example, in order to assign the same execution method to two subsets of the regression suite (but not the entire suite), the following pattern can be used:");
MGCAddSnippet(248, "The following are VRM execution method examples.");
MGCAddSnippet(249, "Note that there are actually only two recommended execution method configurations. If the user wishes to maintain a single list of method elements that apply to the entire database, relying entirely on the conditional attributes to select the proper method for each Action, the method elements should all be defined in the top-most Group of the regression suite, or in a base Runnable referred to by each top-level Group Runnable. If, however, there is a need to define a different set of execution methods for different parts of the regression suite topology, then the top-most Runnables for each of the major sections of the suite should carry a complete set of method elements pertaining to the section of the regression suite defined by that Runnable.");
MGCAddSnippet(250, "The following method definition executes each Action under the time command (to measure the overall CPU time consumed by the Action script). The time stats are emitted to stderr, which must be redirected in order to capture the data. Note the use of the (%TASKDIR%) parameter reference (containing the path to the working directory for the Action) and the (%SCRIPT%) parameter reference (containing the name of the Action itself, used here to build a filename for the output). For examples,");
MGCAddSnippet(251, "The following method definition causes each Action to be queued for execution on a Univa UGE server grid. The basic queue submission command is qsub. The other options cause the queued job to be launched from the same directory as that in which VRM is invoked, to duplicate the existing environment on the grid machine, and to interpret the command as a binary executable.");
MGCAddSnippet(252, "Tests and other user scripts are specified in the RMDB in terms of Actions. The content of the preScript, execScript, and postScript elements are examples of Actions specified in the RMDB. ");
MGCAddSnippet(253, "As Actions become eligible to run, they are added to a single internal queue for processing. A background thread then pulls each Action, in turn, from this internal queue and generates the necessary script and wrapper files. ");
MGCAddSnippet(254, "By default, VRM launches each Action as a separate job, even when launching jobs on a grid. However, because the grid queuing process involves some overhead, it is sometimes more efficient to combine two or more short-running Actions into a single grid job submission. A multi-Action grid job is created when several eligible Actions are clubbed together into a single script that is launched as a single job on a compute grid. Generation of multi-Action jobs is controlled on a per-queue basis. Each named queue is configured via attributes attached to the method element that creates the named queue and that queue s settings apply to any Action which is launched via that named queue.");
MGCAddSnippet(255, "In fixed-list mode, vrun assembles a list of one or more eligible Actions into a multi-Action wrapper script and launches a single execution method command (that is, a single grid job), which is responsible for running the Actions in the list. Each Action in the list is executed in sequence, one Action at a time, as though the Action scripts had been concatenated into a single script. The list of Actions and the sequence in which they are executed is fixed and cannot be altered once the multi-Action command has been launched (hence the name  fixed-list mode ). Also, from that point forward, the individual Actions can no longer be controlled independently, although each individual Action s wrapper script is still responsible for sending the requisite  start  and  done  messages to the launching vrun process.");
MGCAddSnippet(256, "Some Grid Management system support the concept of  array jobs.  These are multi-Action jobs that are submitted to the grid as a single job but which the Grid Management system divides into single jobs as grid servers become available to run the jobs. Platform Computing Corporation Load Sharing Facility (LSF), Univa Grid Engine (UGE), Oracle Grid Engine, previously known as Sun Grid Engine (SGE), and Realtime Design Automation s NetworkComputer (RTDA) support array jobs and the knowledge of how to construct grid jobs in both environments is built into VRM. The advantage of an array job over a fixed-list clubbed job is that the Actions combined into an array job can still run concurrently if the grid has the available capacity (as mentioned above, Actions clubbed in fixed-list mode are always executed sequentially).");
MGCAddSnippet(257, "Since fixed-mode clubbing and grid array jobs are processed by the same algorithm, many of the rules that govern said processing are common for both modes. This section outlines those rules.");
MGCAddSnippet(258, "Different Grid Management systems require different command-line formats to submit array jobs. In keeping with the design goal of allowing environment-specific behavior to be overridden to allow for local customization, an execution method may call upon a user-definable procedure to construct part of the execution method command. Built-in procedures to cover LSF, UGE, SGE, and RTDA grids are built into the vrun executable. Other Grid Management systems that support array jobs require an additional procedure to be defined.");
MGCAddSnippet(259, "If an integer maxarray or maxclubbing value is associated with a named queue when it comes time to launch one or more Actions, a multi-Action job control script is created and launched via the execution method command. This script contains a list of per-Action launch commands, each of which matches the command normally stored in the execution method .bat file for that Action (that is, the command that was launched under single-action mode). The script executes the commands in this list sequentially and each command generates the start and done messages used by the controlling vrun instance to monitor and track the status of each Action. No messages are sent from the multi-Action job control script to the controlling vrun instance.");
MGCAddSnippet(260, "Actions clubbed into a single grid job are executed sequentially, without regard for the sequential mode of the group(s) from which they originated. Since Actions that originate in a sequential group can only become eligible to run one-at-a-time, those Actions will never be eligible to be clubbed together in a single grid job. In order for the members of a given group runnable to take advantage of multi-Action clubbing, they must be members of a non-sequential group; however, said group members, once clubbed, will actually run sequentially.");
MGCAddSnippet(261, "Actions that fail or timeout are still subject to local rerun. However, because the Action is simply submitted to the named queue a second time, it will almost certainly be clubbed with a different set of Actions and/or run in its own grid job (depending on whether any other Actions are eligible at the time). This could cause the multi-Action job control script and stdout/stderr logs for a given proxy Action to be overwritten.");
MGCAddSnippet(262, "You can specify both maxclubbing and maxrunning. ");
MGCAddSnippet(263, "Clubbed Actions running under a single multi-Action job control script receive only one job ID. For that reason, individual Actions within the clubbed job cannot be individually controlled. If the proxy Action for the clubbed job is passed to the suspend, resume, or kill job control options (or the equivalent commands via the control port), the entire multi-Action job is suspended, resumed, or killed, depending on the command or option specified. If the context string of a clubbed Action other than the proxy Action for the given job is passed to one of these commands/options, then nothing happens.");
MGCAddSnippet(264, "A related but independent function is the ability to limit the  execution window  of a given named queue. If the window attribute is specified for a given execution method, that attribute is used to establish a window of time during which the jobs launched from that queue are allowed to run. The value of the window attribute is parsed into one or more semicolon-separated expressions. Each expression consists of a limit type identifier and a limit value string separated by a colon. The only limit type identifier defined at this time is  wall  that means wall-clock time measured from the time the first job is launched. The limit value string follows the rules outlined in the man page for the TCL clockscan command. ");
MGCAddSnippet(265, "One requirement of a good regression management system is the ability to rerun failed tests, possibly with additional debug output enabled. There are a number of ways in which VRM allows the user to rerun Actions from a previous run according to their status. The most obvious use for this function is to rerun tests that failed, either as is to filter out  noisy  failures or with different command-line options to enable additional debugging output.");
MGCAddSnippet(266, "VRM supports various levels of rerun functionality whereby failing Actions (that is, tests) can be re-executed, either as part of the same regression run or as part of a subsequent regression run. This section describes a level of failure rerun support called  local rerun  or  immediate rerun  (this document uses the local term).");
MGCAddSnippet(267, "When local rerun is enabled, VRM calls the OkToRerun procedure immediately after AnalyzePassFail (in the case of a failure) and if this procedure returns a true value, then VRM re-queues the Action.");
MGCAddSnippet(268, "A default behavior is built into VRM so users can take advantage of local rerun without having to write an override implementation for the OkToRerun user-definable procedure. Under the default behavior, queue timeouts (status: timeout/queued) are treated separately from other kinds of failures. If an Action fails with a queue timeout (that is, the Action was launched but never reported having started), the Action is rerun unconditionally, regardless of its past history of failure. A queue timeout is most likely caused by a failure in the underlying grid management software or by a machine accepting a job but being unable to actually run it. In this case, re-launching the Action could fix the problem. So queue timeout failures always trigger a local rerun.");
MGCAddSnippet(269, "The OkToRerun procedure, like all other user-definable procedures, is passed a reference to a TCL array containing various context-specific data items. To override this procedure, the user writes a TCL procedure, generally following the example template shown below, and include it either in an auto-loaded usertcl element or in an external file loaded with the -loadtcl command-line option. ");
MGCAddSnippet(270, "The use models suggested above are the two obvious common cases. In some regression environments, the simulation server grid (or the software that manages the grid) could drop one or more queued jobs at random. When this happens, the grid job will fail to run. As a result, the Action wrapper script will fail to report the start event, which will cause vrun to report a queue timeout. In order to combat this particular irregularity, the default local rerun functionality will always rerun an Action that fails due to a queue timeout. The parameters used to rerun the Action will remain unchanged from the previous run.");
MGCAddSnippet(271, "The vrun process can be instructed to dump out a log containing the full context path of the Runnable responsible for any Action that fails. Actions that encountered a timeout after launch are counted as failures, and Actions that did not run due to a failed dependency and/or a manual interrupt are also counted as failures. ");
MGCAddSnippet(272, "The logging of failed Actions is enabled with the -faillog option whose option value is the path to a file in which the list of failed Runnables are recorded. If the path is not absolute, it is assumed to be relative to the directory from which vrun is launched. Any existing content in the file at the time vrun starts up is deleted.");
MGCAddSnippet(273, "Failed Actions logged in the -faillog file from a previous run can be rerun by inserting the full context chains listed therein on a subsequent vrun command line as follows:");
MGCAddSnippet(274, "The Global method of specifying a failed test log file involves adding a special predefined parameter to each Group for which a failed test log file is to be maintained. This method only works with execScript Actions. If vrun is able to resolve the parameter reference (%faillog:%) to a non-empty string for any given execScript Action, it assumes the parameter value represents the path to a file in which a list of failing Tasks, one-per-line, is to be stored. If the execScript reports a failure, it adds the context path of the Task (without the trailing execScript component) to this file. There can be more than one such file. You might, for example, have two or three top-level Groups, each of which maintains its own failure log. In that case, you would define a unique faillog parameter in each Group and the file path specified in each of those parameters would apply to all the Tasks under that particular Group (at any depth, since inheritance knows no limits).");
MGCAddSnippet(275, "This section describes a way to identify failing Actions from a previous run. The -select command-line option takes one or more status keywords and searches the event log from the immediately previous run for Actions that match the specified keywords. It then converts the Action context path into a Runnable context path and then selects that context path for execution as if it had been included directly on the vrun command line.");
MGCAddSnippet(276, "Two or more vrun commands are required to implement a complete failure rerun scheme in semi-automatic mode. In order to encapsulate the required command-line options into the RMDB file, a macro Runnable can be defined that recursively calls vrun as many times as needed to complete the regression run. For example, suppose your regression environment requires that failing and/or timed out tests be rerun once with a slightly longer timeout (to weed out noisy failures) and those that still fail to be run with a debug-mode parameter set so the tests are ready to debug when the designer arrives the next morning. The set of three vrun commands might look like the following:");
MGCAddSnippet(277, "VRM supports a single-command automated way to run two passes over a given regression suite, picking up additional command-line options on the second pass. The -rerun option takes a string that contains the additional command-line options for the second pass (which must be an empty argument should you decide to run the regression suite twice with the same arguments both times). The command is as follows:");
MGCAddSnippet(278, "When running a random simulation, a random seed can be supplied to vsim via a command-line option. The simulator guarantees that the same design run twice with the same seed will produce the same results. This is known as  random stability  and is essential to allow bugs exhibited by purely random simulations to be reproduced and debugged. When a series of random simulations are executed for the purpose of locating seeds with good coverage (or which turn up corner-case bugs), it is common to pass the word  random  to the simulation as a seed, as opposed to a fixed numeric seed value. This tells the simulator to select a seed at random at the start of the simulation. Of course, if a test is run twice with the word  random  as the seed, the results of the second run will almost certainly not match the results of the original run.");
MGCAddSnippet(279, "After generating the necessary files, vrun launches the Action and waits for the  done  message to arrive from the wrapper script for that Action, indicating that the user's script has exited and returned control to the wrapper. From this point until vrun continues with the next Action is called  post-execution analysis.  The behavior of VRM as it analyzes and reacts to the results of each completed Action is highly customized. Therefore, most of the steps involved in post-execution analysis are user-definable, with reasonable default behavior for the common case.");
MGCAddSnippet(280, "Before vrun can decide how to react to a completed Action, it must determine if the Action in question passed or failed. For purposes of pass/fail analysis, each execScript Action is assumed to run, at most, one simulation. The preScript and postScript Actions are assumed not to run simulations (the preScript and postScript Actions are primarily used for compile, setup, and/or post-processing commands). These assumptions can be overridden in the RMDB database as described below.");
MGCAddSnippet(281, "A failed Action (one which either fails to launch, returns a non-zero status, or is marked as failed in the UCDB) can also have an effect on subsequent Actions that depend on (that is, follow) the failed Action. This mechanism is called  failure propagation  and is intended to help prevent cases where some critical Action within a regression suite (such as design compilation) fails but the remainder of the regression continues on as if nothing happened. ");
MGCAddSnippet(282, "The AnalyzePassFail procedure uses the information at its disposal to determine whether the completed Action passed or failed. It returns either pass or fail (as a case-sensitive string). ");
MGCAddSnippet(283, "The ActionCompleted procedure is called after every Action and provides the user with a means to notify other processes of the completion of the Action, save off collateral files, or perform other housekeeping duties (this notification/cleanup procedure should not be used to run commands that should be, more properly, a part of the test suite itself; the purpose of this procedure is to provide a way for VRM to integrate into pre-existing flows).");
MGCAddSnippet(284, "It is assumed that in the majority of cases, VRM is used to launch simulations whose coverage data is accumulated and recorded in UCDB files (if this is not the case, this section may be ignored). ");
MGCAddSnippet(285, "The MergeOneUcdb procedure is passed the path to a single UCDB file and the path to a merge file. The procedure then executes the steps necessary to merge the single UCDB into the merged UCDB file. The procedure returns nothing. The default behavior of this procedure (if not overridden by the user) is to merge the UCDB defined by the value of the ucdbfile array member into the UCDB file defined by the value of the mergefile array member. The vcover merge executable is used without any additional options. In addition, the log output of the vcover executable defaults to stdout, and is echoed to any explicitly supplied log file. This flow could be called an incremental merge flow because each UCDB is merged into the common file as it is encountered.");
MGCAddSnippet(286, "In some cases, a fundamental design or testbench failure can cause a large number (if not all) of the Tasks in the regression suite to fail. In this case, early termination of the regression run can prevent processing resources from being wasted on simulations that cannot provide any additional information. By default, VRM always attempts to run every Action defined in the database. The user can override this behavior and provide a heuristic function that will terminate a regression run prematurely in the face of such catastrophic failure.");
MGCAddSnippet(287, "A typical regression suite consists of a large number of inter-related Actions. Many of those Actions depend on the successful completion of previous Actions in the suite. For example, one of the uses of the preScript Action is to compile the Design Under Test (DUT) in preparation for running the actual simulations. If the compile step fails for some reason, the simulations will also be unlikely to succeed and, thus, executing them would be a waste of disk space and compute capacity. VRM is capable of pruning the execution graph in response to failed Actions. This it not unlike the behavior of the make utility when faced with a failing build step. Unless otherwise directed, the default behavior of make is to stop the build on the first error encountered.");
MGCAddSnippet(288, "The auto-delete mechanism in VRM allows the user to configure VRM to selectively delete files from the VRM Data directory as a regression run progresses. This is primarily useful for those situations in which a limited amount of disk space is available and some of the collateral files generated by a given test (or by VRM to support the test execution) are no longer needed once that test finishes. For example, the user can configure a regression such that all files associated with a passing test are deleted once the test is complete and the coverage is merged into the merged UCDB file. Likewise, the user can configure a regression to preserve all UCDB and/or log files from passing tests and to preserve all files from failing tests (to facilitate reproduction of the failure) but to delete everything else.");
MGCAddSnippet(289, "The basic execution graph for a single Group Runnable with two Task Runnable members is as shown.");
MGCAddSnippet(290, "VRM supports several levels of automation of UCDB-based coverage merging. This functionality is a Questa specific value-added feature that must be enabled through the use of predefined parameters in the database. Coverage merging can also be performed manually via Action scripts defined by the user. The various coverage options available for merging coverage information follows.");
MGCAddSnippet(291, "The following assumptions are made about the environment and the flow when merging coverage data under VRM:");
MGCAddSnippet(292, "The following general example is used to illustrate the various levels of automated merging. The following RMDB database does not include any provision for coverage merging, as that is added (in various ways) throughout the remainder of this chapter.");
MGCAddSnippet(293, "As each Action script reports completion (or times out), VRM does some internal post-processing on the results. With a few minor exceptions, the post-processing steps can all be controlled via user-supplied TCL code. This is because the post-processing is actually performed by calling a series of user-definable TCL procedures, each of which has a predefined default behavior. In theory, there are an infinite number of possible behaviors for this post-processing (which necessarily includes the coverage merging step). This chapter covers the default behavior provided within VRM itself (without any TCL-based user overrides).");
MGCAddSnippet(294, "By default, VRM supports three levels of automation for coverage merging, as described in the following sections. ");
MGCAddSnippet(295, "Under the DIY merging flow, the user is responsible for calling vcover merge with the proper arguments at the proper time. Those execScript Actions that represent regression tests (that is, those which run simulations) should always generate a UCDB file at the location designated by the ucdbfile parameter in order to support automated pass/fail checking. However, VRM itself will not perform any automated merging. Any coverage merging is performed by the user s code in one of two ways.");
MGCAddSnippet(296, "The list-based merging flow is similar to the DIY flow in that each simulation produces a UCDB file and the postScript Action of a higher-level Group must manually invoke the vcover merge command. The difference is that the postScript Action does not have to search for the UCDB files with a wildcard, as vrun maintains a list of UCDBs from tests that are eligible for merging. ");
MGCAddSnippet(297, "The incremental merging flow automates one of the merging schemes mentioned in the previous section. This semi-automated use model serves mostly as a user convenience. Under this flow, parameters are used to point to the UCDB file for each individual regression test and to a target merge file. As before, the execScript Actions that represent regression tests (those which run simulations) each generate a UCDB file at the location designated by the ucdbfile parameter in order to support automated pass/fail checking. VRM then calls vcover merge as each execScript completes in order to merge the coverage of the individual tests into the target merge file.");
MGCAddSnippet(298, "The queued merging flow is the default if both the ucdbfile and the mergefile parameters are defined for a given execScript Action.");
MGCAddSnippet(299, "Since the queued merging model differs from the incremental merging model only in the internal implementation details, the examples given for incremental merging are equally useful here.");
MGCAddSnippet(300, "The following two subsections discuss tips and traps of auto-merging.");
MGCAddSnippet(301, "VRM implements a pair of user-definable functions that can be used to implement a  delete-on-pass  algorithm (where intermediate files generated by passing tests can be deleted on-the-fly to save disk space). When auto-merging (incremental or queued) is enabled, the MergeOneUcdb post-execution step only queues the mergeScript Action for later execution. If the OkToDelete user-defined procedure returns a true value, the script files necessary to perform the merge can be deleted before the merge itself has been completed. The OkToDelete user-defined procedure should not be overridden if auto-merging is enabled.");
MGCAddSnippet(302, "The OkToMerge user-defined procedure can be overridden to control whether or not a given UCDB is to be merged into the mergefile target (for example, based on whether the test passed or failed). But since MergeOneUcdb shares the same data array parameter as OkToMerge, the OkToMerge procedure can actually be overridden to do the following:");
MGCAddSnippet(303, "The auto-merge and auto-triage algorithms can detect the first merge/triage operation directed at a specific mergefile or triagefile and to detect whether a file already exists at the target location. If so, then the existing file is assumed to be from a previous regression run and is deleted/cleared prior to the first merge/triage operation.");
MGCAddSnippet(304, "When queued auto-merge and/or queued auto-triage are enabled in a regression run, UCDBs representing Actions that completed during an active merge or triage operation are queued and clubbed together in a subsequent merge or triage operation. ");
MGCAddSnippet(305, "Testplan auto-import is an optional adjunct to the auto-merge functionality in VRM. The testplan is usually represented as a XML file exported from a documentation application, such as Microsoft Excel or Microsoft Word. A Questa utility converts this XML file into UCDB format and the resulting UCDB is merged with the UCDB files generated from the individual tests. While there are any number of ways by which to accomplish the same task via commands in the VRM preScript and postScript Actions, the common case can be automated via parameters in the RMDB file.");
MGCAddSnippet(306, "This section summarizes how the various merge flows are triggered and who is responsible for the vcover merge command.");
MGCAddSnippet(307, "An automated flow is available for results analysis (triage). Triage is a means of collating messages from multiple verification tasks that make the regression into a single view. Through grouping and filtering, the user can easily determine common failures and patterns.");
MGCAddSnippet(308, "Under non-queued incremental auto-merge and auto-triage, each completed UCDB file results in a separate merge/triage operation to handle that specific file. Because of file locking, multiple concurrent merge and/or triage commands to the same target file can experience additional latency as the locking algorithm blocks all but one of the concurrent commands from accessing the target file at any given time. VRM supports queued versions of incremental auto-merge and auto-triage that avoid this file locking latency.");
MGCAddSnippet(309, "This functionality facilitates the tracking of verification plan coverage over time, specifically it allows you to monitor the changes in coverage information for merge files collected over different regression runs.");
MGCAddSnippet(310, "The example makes use of the queued auto-merge functionality in vrun. The merge is divided into two levels, the second-level merge being responsible for merging two merge files produced by the first-level merge. This example also illustrates how unit-level and system-level coverage can be merged into a single UCDB using VRM. ");
MGCAddSnippet(311, "The block under test is a Hamming parity generator module (mlm_par), purposely written as a series of SystemVerilog if statements in order to achieve partial statement coverage (if it were written with continuous assign statements, every statement would be covered by every test). This block is tested under two testbenches. One (mlm_uni) simply instantiates the block once, drives some sample values, and prints both the input value and the resulting Hamming parity code. The other testbench (mlm_sys) instantiates two parity blocks as part of an encoder/decoder module pair that test the ability of the Hamming code to repair single-bit failures. The second testbench also has a self-checking mechanism built-in. ");
MGCAddSnippet(312, "The Verification Run Manager DataBase (RMDB) file is the VRM database.");
MGCAddSnippet(313, "The two first-level merges are more or less identical, so the merge under systemtest is used as an example for purposes of this discussion. The systemtest Runnable defines a parameter called group whose value is systemtest. This is only needed because systemtest and unittest share many configuration elements and the group parameter allows these shared elements to be parameterized to match the Group in question.");
MGCAddSnippet(314, "Inheritance solves a lot of problems in the general case. It allows a common parameter value to be entered into the RMDB database once and still be visible from large parts of the regression topology. It allows complex parameter values to themselves be parameterized using a simple parameter (such as a testname or a seed) defined in each test. Auto-merging is the one place where this flexible inheritance architecture works against us.");
MGCAddSnippet(315, "The second-level merge is very similar to the two first-level merges. It is worth noting that the only two execScript Actions under the nightly subtree that are not also under one of the two main Groups (unittest and systemtest) are the execScript Actions under unittest_merge and systemtest_merge. This is intentional, since the two first-level merge files generated by those Actions are to be the only input files to the second-level merge. If other Task Runnables were defined at this level, their UCDBs would also participate in the second-level merge (which might also be intentional, under the right circumstances).");
MGCAddSnippet(316, "This section shows a complete multi-level auto-merge example.");
MGCAddSnippet(317, "VRM is designed to be a versatile scripting solution for a wide variety of regression flows and users. The basic architecture of nested Groups of Tasks following the preScript, execScript, postScript execution model is, itself, already quite extensible. Support for parametrized commands within those scripts further enhances that extensibility. However, the details involved in each step of the execution process are not quite as clear-cut. There are two approaches that must be balanced against one another as follows:");
MGCAddSnippet(318, "There are certain aspects of the behavior of VRM that depend on assumptions about the verification environment. For some of these behavioral details, VRM defines an appropriate default that should work for the majority of environments and a mechanism whereby that behavior can be modified by the user at runtime. For each modifiable aspect, the default behavior is implemented in an isolated TCL procedure within VRM. To override this default behavior, the user creates a TCL code fragment that defines a procedure of the same name as the procedure to be overridden. This code fragment is written to conform to the same interface as the original function and is loaded into VRM at runtime. When VRM invokes the procedure, the user's version of that procedure is used instead of the built-in procedure. The procedure as defined by VRM is called a  user-definable  procedure. The procedure supplied by the user to override this procedure is called a  user-defined  procedure.");
MGCAddSnippet(319, "In some cases, it is necessary to load user-defined TCL code into VRM (technically, into the TCL interpreter that is executing the VRM application). This TCL code can be specified in the RMDB database or in a separate file. Once specified, the code can be loaded via a command-line option or automatically at the start of the VRM run. Any TCL code so loaded becomes a global part of the VRM application. Procedures defined within the loaded code can be called from TCL-type parameter value expressions or from user-definable procedures. ");
MGCAddSnippet(320, "In the course of running a regression suite using VRM features, one ends up generating a large number of UCDB, WLF, and other log files that must be analyzed. Coverage information must be merged and/or ranked in order to get a handle on how well the entire regression suite tests the design. Error messages must be triaged in order to pinpoint the unique error messages resulting from that run. From the point of view of the VRM tool, it all boils down to collecting simulation collateral files, sorting them by test status, and making those file lists available to the user's post-regression analysis script.");
MGCAddSnippet(321, "The following describes the basic regression suite being used as an example in this case:");
MGCAddSnippet(322, "This section is not so much about gathering and classifying UCDB files as making such gathering unnecessary. VRM supports full automation of coverage merge and failure triage across an entire regression suite. The user scripts have very little to do other than producing the final reports, as the following example illustrates:");
MGCAddSnippet(323, "The event log records certain information for every Action launched by VRM. One of the bits of information recorded is the path to the UCDB file (if the ucdbfile parameter is defined for the execScript Action in question). The following additions to the basic example allow the postScript Action for the  nightly  Group to extract two lists of UCDB files from the event log: one for passing Actions and one for failing Actions. These lists are then passed to vcover merge and triage dbfile, respectively:");
MGCAddSnippet(324, "The auto-merge functionality build into vrun allows a UCDB file produced by an execScript Action to be merged into a target merge file merely by defining certain parameters in the Runnable where the execScript itself is defined.");
MGCAddSnippet(325, "Another approach is to compile two text files, one with a list of UCDB files from failed tests and one with a list of UCDB files from passing tests. These list files can then be used in subsequent vcover merge and triage dbfile commands. The following is one way such an approach might be implemented:");
MGCAddSnippet(326, "Auto-delete is enabled by overriding the user-definable procedure OkToDelete (see below for a detailed description of this procedure). The OkToDelete procedure is called upon the completion of every Action (except, of course, for the deleteScript pseudo-Action). The decision of whether or not to delete a given directory is based on a veto system. Each deleteScript pseudo-Action carries a flag that indicates whether or not the directory associated with that pseudo-Action is safe to delete. That flag is set to  yes  by default (that is, the directory is safe to delete). If the OkToDelete procedure returns a false value for any of the Actions associated with the same directory as the deleteScript pseudo-Action, that flag is set to  no . ");
MGCAddSnippet(327, "Following are the ways to protect one or more files from deletion:");
MGCAddSnippet(328, "Even if the RMDB has redefined the OkToDelete user-definable procedure in such a way as to enable auto-delete, it is still possible to block auto-delete from deleting anything during a given regression run. If the -noautodelete command-line option is specified at the start of a regression run, auto-deletion is disabled globally for the entire regression suite. The deleteScript pseudo-Actions are still generated and the OkToDelete user-definable procedure are not called and the deleteScript pseudo-Actions are ignored when they come up for execution.");
MGCAddSnippet(329, "The vrun command line supports -dumpgraph and -dumpgraphviz to list the Actions which would be executed rather than actually executing them. Neither of these options list the deleteScript pseudo-Actions, as these are not real user-defined Actions. Also, the deleteScript pseudo-Actions are not listed as  skipped  (and, in fact, are not skipped) as a result of errors earlier in the execution graph. They will, however, be listed as unhandled if the StopRunning user-definable procedure returns true and terminates the regression run, or if the run is prematurely terminated by a user interrupt (using Ctrl-C).");
MGCAddSnippet(330, "As mentioned above, the deleteScript pseudo-Action is handled entirely within the vrun process responsible for managing the regression run. Once pulled off the run queue, if the flag on the deleteScript pseudo-Action indicates that there is no objection to the deletion, the deleteScript pseudo-Action is placed in a deletion queue (to ensure all scheduled deletions take place before the vrun process exits) and an internal deletion procedure is scheduled for execution after a fixed time (5 seconds). The delay is to ensure that the Action that just finished in the directory slated for deletion has actually exited and closed all its file handles. Once started, the deletion of a single Runnable directory runs until completion (without a timeout). Subdirectories within the directory being deleted are also deleted recursively unless they are marked with the special .VRM tag file (which indicates that the directory is associated with a member Runnable and is already subject to a separate but identical auto-deletion process).");
MGCAddSnippet(331, "The auto-clean function is enabled by default and requires no user intervention. Auto-clean deletes the old content of each working directory before the first script (preScript or execScript) runs in that directory. The purpose is to prevent the files from previous simulations from interfering with a new simulation (or providing bogus status and/or coverage data) when the same VRM Data directory is used for multiple regression runs.");
MGCAddSnippet(332, "The auto-delete and auto-triage functions delete the merged UCDB file and the TDB file, respectively, when the first reference to each file occurs in a given regression run. This function can be disabled by including either the -noautomergedelete or -noautotriageclean options on the vrun command line (note that TBD files are  cleared  by issuing the triage dbfile -clear command). ");
MGCAddSnippet(333, "The vrun command provides command-line access to the Verification Run Manager.");
MGCAddSnippet(334, "The vrun command reads and records all command-line options before processing begins. In the case of options with the same semantic (that is, -loadtcl, -G, and so on), the semantic of the option can impose an order-based priority on the individual option values. Between options of different types and/or bareword arguments, there is no inherent order dependency.");
MGCAddSnippet(335, "This command set controls the counter configuration in the VRM Cockpit window and the counters in the VRM Results window status bar.");
MGCAddSnippet(336, "The following vrun command-line options are used to control a remote vrun process and/or the jobs running under that process. The vrun process receiving one of these options connects to a remote vrun process via its status event socket and issued a command of the same name as the command-line option (that is, vrun-exit issues an exit command via the socket to the remote vrun process).");
MGCAddSnippet(337, "All messages are produced on the standard output of the VRM process or in the transcript of the invoking vsim session.");
MGCAddSnippet(338, "The following terms are used throughout this manual to refer to specific objects with the VRM environment.");
MGCAddSnippet(339, "The following terms are used to reference parts of the XML database format. The terms and their definitions are inherited from the XML specification.");
MGCAddSnippet(340, "Certain typographical conventions are used to indicate when a word is being used for its VRM specific definition or simply as an English word. In general, the following rules apply:");
MGCAddSnippet(341, "The communication of VRM relies on these various topics.");
MGCAddSnippet(342, "The vrun command always opens a TCP/IP socket on which it listens for status messages from the Action scripts it launched. This channel supports the following message types:");
MGCAddSnippet(343, "In this mode, the vrun command is executed from a shell or from the vsim transcript window. There is no interaction with the user once the process is kicked off. VRM receives status from the Action scripts and maintains internal tables representing the state of the regression suite. All status output from VRM is via the log output (stdout). The only way to stop the regression run is to kill the vrun process.");
MGCAddSnippet(344, "The  core engine  of VRM is the vrun application. When managing a regression run, the vrun application is essentially a batch-mode process. It launches jobs and reports their status on a text-based log stream (via stdout or via the vsim transcript stream if launched from vsim). A single vrun process is responsible for a single regression run (although vrun can call additional instances of itself, depending on the user's configuration, these child processes are also considered separate regression runs). The only direct control the user has over the regression process is through the RMDB database file and by way of command-line options specified at the time the vrun process is launched.");
MGCAddSnippet(345, "The communication channel format follows a text-based model. Each  message  consists of one or more text records delimited by a newline character (that is, each message looks like a single line of text). Messages to the vrun process always begin with a single-token keyword and contain a variable number of arguments. All keyword/argument tokens are passed in TCL list form (escaped as necessary). This helps reduce conversions from one format to another under various circumstances. For example, the TCL list can be passed as arguments to a TCL procedure, serialized for transmission over a socket, or encoded onto a vrun command-line for user-level access. All messages occur as the result of some event (that is, a state change in an Action (or possibly in VRM itself) or a user request).");
MGCAddSnippet(346, "Status messages from an Action script to the vrun core follow a fixed format that looks as follows:");
MGCAddSnippet(347, "If an error is detected in a message received by vsim via the open event message socket, the single response  Eh?  will be returned. This is just a human feedback mechanism, as the messages in each case do not involve a handshake mechanism. The vrun application ignores messages with  Eh?  as their first token, in order to prevent a listening application from starting a feedback loop of error messages between itself and vrun.");
MGCAddSnippet(348, "Every status event message generated by the vrun core is also logged in an event log. The event log is created in a directory called logs directly under the head of the VRMDATA directory for that regression run. The name of the log file is derived from the date and time when the regression run started, with the extension of .rmev. The file names are formatted such that a simple lexical sort yields the sequence in which the individual regression runs were executed. Any application that knows the path to the head of the VRMDATA directory can discover the event logs from all past regression runs involving that VRMDATA directory.");
MGCAddSnippet(349, "Using the examples in this chapter you can learn how to a process using its event log.");
MGCAddSnippet(350, "The vrun command line supports multiple modes. One is the default  run  mode in which vrun launches new jobs. Another is a  send  mode in which vrun simply sends a message to a specified port on a specified host and exits. This  send  mode is used by the wrapper script to send the start and done messages and can also be used within the user's script to send informational messages that appear in the log output stream of the vrun process. The following command-line options and usage are included in the output of the -help option of the vrun application:");
MGCAddSnippet(351, "The architecture of VRM is intentionally general. By default, Action scripts (preScript, execScript, postScript, and others) are launched as child processes on the local machine. The RMDB file can specify execution methods for all or a select group of Actions that cause the Action scripts to be launched in a user-specified manner. This can be used to launch remote processes on specific servers, to wrap a given Action script in another script, or to submit the Action script for execution on a compute grid or server farm. The user only needs to provide a template for the command necessary to launch a given script and vrun will follow the instructions set by the user when launching the scripts associated with that execution method.");
MGCAddSnippet(352, "In order for vrun to know which Action scripts are associated with which grid management system, it is necessary for a grid type string to be specified in the RMDB file. Since a job queued to a compute grid must make use of an execution method, the method element associated with said execution method is the best place to specify the grid type. A gridtype attribute on the method element can be set to a non-empty string to specify the set of grid management commands to be used when controlling the resulting grid job. Except for the two built-in grid types (lsf, uge, sge, and rtda), this string can be any arbitrary (legal) identifier. The string is used later as the basis for calling one or more user-definable procedures that control the jobs after launch.");
MGCAddSnippet(353, "The grid type values lsf, uge, sge, and rtda are predefined and built-in to the vrun application. This section assumes some other grid management system is in use. In the following example, the grid type in the listed method element is set to the arbitrary string  fred :");
MGCAddSnippet(354, "A pro-active grid status check, enabled by default, verifies that all Actions submitted to a grid management system, which have not yet completed, are still listed by the grid management system as either pending or running. This allows VRM to detect anomalous behavior in the set of submitted jobs without waiting for a timeout. ");
MGCAddSnippet(355, "Actions for which no execution method is defined, or for which the selected execution method does not specify a grid type, are assumed (for job-control purposes) to have been locally launched. If the vrun process is able to determine the process identifier (pid) for the resulting child process, any job-control operations is applied to those jobs via the POSIX-standard kill command. The following signals are sent to the child process via the kill command in order to control the process:");
MGCAddSnippet(356, "There are several user-definable procedures are already defined by default in the vrun application.");
MGCAddSnippet(357, "Once the vrun application starts launching Action scripts, the only way to communicate with the vrun process is via the TCP/IP socket opened for communication with the wrapper scripts. The port@host on which any given vrun process is listening is published in the log output of that process (usually as the first message, except in -debug mode). Any process can connect to this socket and send one of the following messages to the running vrun process:");
MGCAddSnippet(358, "The vrun application has a mode via which it simply passes a message to another vrun command and then quits. This is a convenience feature designed to make it easier to control a running vrun process once launched. ");
MGCAddSnippet(359, "When an Action script is suspended, any non-zero timeout is temporarily suspended. For example, if an Action script launched with an execution timeout of 90 seconds is suspended after 30 seconds of runtime, in theory that Action still has 60 seconds of runtime remaining. If the suspension lasts longer than that, the Action will not timeout. Instead, when the Action script resumes execution, its timeout is adjusted such that it will not timeout until 60 seconds after the time it resumes execution. In other words, the Action script is always allowed to execute for the time specified in the execution timeout (timeoutQ) without penalty.");
MGCAddSnippet(360, "There is nothing special required to run VRM with JobSpy. Simply set the JOBSPY_DAEMON environment variable before invoking VRM. Make sure that any exec-mode scripts preserve the environment from the invoking process (for example, by using the -f option with /bin/csh). Execute vrun specifying some set of Tasks that represent Questa simulations and as the simulations run, they should show up in the JobSpy job list.");
MGCAddSnippet(361, "Reference information about environment variables and built-in parameters for VRM.");
MGCAddSnippet(362, "The following environment variables are recognized and used by VRM:");
MGCAddSnippet(363, "The following parameters are built-in to VRM and are always defined within their respective context. These parameters can be overridden via the -G command-line option. However, due to the nature of the data contained in these parameters, they should only be overridden by someone who understands the tool very well. ");
MGCAddSnippet(364, "The parameters in this section receive special treatment when defined in the RMDB database.");
MGCAddSnippet(365, "Most element attributes in the XML database are used verbatim. ");
MGCAddSnippet(366, "There are a number of parameters and element attributes whose values represent files and/or paths. While absolute paths can be specified in any of these places, in general these parameters and attributes are specified as relative file/path names. The following basic rules explains how VRM resolves these relative paths:");
MGCAddSnippet(367, "This chapter documents each of the user-definable procedures, and the low-level utility procedures available to the user-definable procedures. ");
MGCAddSnippet(368, "Each user-definable procedure listed in this reference includes the following sections:");
MGCAddSnippet(369, "The following groups of procedures are user definable and available for your use:");
MGCAddSnippet(370, "There are a number of common key/value pairs passed to every user-definable procedure in the data array. The values represent file names and/or paths that are global to the entire regression run.");
MGCAddSnippet(371, "The following procedures are called by vrun when the global status of the regression run changes:");
MGCAddSnippet(372, "This procedure is executed after the execution graph and other VRM internal data structures have been initialized, but before the first round of Actions are initiated. This is a convenient place to put any global initialization code required for the other user-definable procedures to execute (it should not be confused with the preScript Action run as part of the top-level Group).");
MGCAddSnippet(373, "This procedure is executed after all Actions resulting from the selected set of Runnables have either been executed or abandoned. It is a convenient place to emit status information to the log file, to populate GUI widgets when VRM is being executed from inside the vsim GUI, to notify third-party applications of the completion of the regression suite, or to kick off post-regression analysis scripts.");
MGCAddSnippet(374, "The vrun process maintains an idle loop that runs either once a second or any time a status message is received from a running Action script. The idle loop is mostly responsible for launching eligible Actions and for detecting timeouts on running Actions. This procedure is called once for each pass through the idle loop. It was created as part of the auto-merge experimentation but is no longer used for anything. It can be used for any update process that must run continually throughout the regression run but cannot easily be tied to a positive event. Care should be taken when overriding this procedure as any lengthy processing can have a significant impact on VRM performance.");
MGCAddSnippet(375, "The following procedures are called by vrun whenever the status of an Action changes:");
MGCAddSnippet(376, "This procedure is executed when the prerequisites of an Action are completed and the Action has been queued for execution. Note that this event does not imply that the Action has actually been launched (or queued to a grid), nor does it indicate that the VRMDATA directory for the Action has been created or prepared.");
MGCAddSnippet(377, "This procedure is executed when the Action has been launched or queued for execution on a grid system. The working directory for the Action will have been created and prepared by this point.");
MGCAddSnippet(378, "This procedure is executed when the Action has begun execution. Since this event comes from the wrapper script, it indicates that the Action has successfully started and is actually running.");
MGCAddSnippet(379, "This procedure is executed after each Action completes. Its purpose is to provide a post-completion hook to notify the Questa GUI (or 3rd-party utilities) of the completion of an Action. This procedure is also responsible for handling any collateral files (that is, log files, results files, and so on) that the user may wish to save outside of the VRM working directory tree.");
MGCAddSnippet(380, "The following procedures are called in a specific sequence upon the completion of any Action:");
MGCAddSnippet(381, "After each Action completes this procedure will analyze the collateral files generated by the Action and determine if the Action passed or failed. By default, this procedure accomplishes this goal by analyzing the UCDB status, alternatively it can perform a comparison against golden simulation results.");
MGCAddSnippet(382, "This procedure provides cached access to the coverage data in a UCDB file, fetching either total coverage or testplan coverage");
MGCAddSnippet(383, "This procedure tests whether a given UCDB file is or is not a merged UCDB file. ");
MGCAddSnippet(384, "This procedure returns the state of the merge/triage auto-rerun function. ");
MGCAddSnippet(385, "This procedure is called for each failing Action (whether the failure is a hard failure or a timeout). If the procedure returns a true value, then the failing Action is re-queued for another execution. If the procedure returns a false value, then the Action is not rerun. This procedure can also call the OverrideRmdbParameter procedure to alter parameter values (for the Action in question only) prior to the next execution.");
MGCAddSnippet(386, "This procedure is executed after each Action completes, but only if a UCDB coverage file for the Action has been identified. Its purpose is to determine whether the circumstances related to the Action just completed warrant merging of the UCDB coverage data into a common merge file. If the user environment specifies that only the coverage data from passing simulations should be merged into the final UCDB coverage file, then this is the procedure where that policy is implemented.");
MGCAddSnippet(387, "This procedure is called if the OkToMerge procedure returns a  true  value. It causes the data in the UCDB coverage file for this Action to be merged into a common merge file.");
MGCAddSnippet(388, "This procedure is called at the end of the regression. It is called for each mergefile marked for trending, using the context of the Task where the trendfile was first encountered. The mergefile is passed as the ucdbfile input argument for the procedure. ");
MGCAddSnippet(389, "This procedure is executed after each Action completes, but only if a UCDB coverage file for the Action has been identified. Its purpose is to determine whether the circumstances related to the Action just completed warrant adding the log messages from the Action to the triage database. If the user environment specifies that only the messages from failing simulations should be added to the triage database, then this is the procedure where that policy is implemented.");
MGCAddSnippet(390, "This procedure is called if the OkToTriage procedure returns a  true  value. It causes the data in the UCDB coverage file for this Action (and, by reference, the messages in the WLF file for this Action) to be loaded into the failure triage database.");
MGCAddSnippet(391, "This procedure is executed after each Action completes (it is not called for deleteScript pseudo-Actions). The purpose of this procedure is to determine if conditions are such that the working directory for the Action may be scheduled for deletion (for example, to implement a  delete-on-pass  disk-space conservation scheme). ");
MGCAddSnippet(392, "The following procedures allow the user to customize the behavior of key portions of the VRM regression algorithm:");
MGCAddSnippet(393, "This procedure allows the user to capture the list of Runnables selected from the command line or to customize how Runnables are selected. This procedure is called immediately after the runlist (if any) is read and the command-line arguments have been processed into an include/exclude list (but just before the include/exclude list is expanded into the Runnable selection (sparse) tree). ");
MGCAddSnippet(394, "This procedure is executed after each Action completes (immediately prior to scheduling any dependent Actions for execution). Its purpose is to determine if dependent Actions should be abandoned based on the pass/fail status of the current Action. This is used where, for example, testing cannot continue if a critical compilation step failed. In order to change the VRM policy on when downstream actions should be skipped as a result of the failure of an earlier Action, this is the procedure to override.");
MGCAddSnippet(395, "This procedure is executed after each launched Action completes or experiences a timeout (immediately prior to scheduling any dependent Actions for execution). It is not called for Actions that are skipped, dropped, or not executed for some reason. Its purpose is to determine if there have been sufficient failures to warrant cancellation of the entire VRM regression run.");
MGCAddSnippet(396, "This procedure is called to retrieve the next iteration token to be used in place of the * token in a dynamically repeating Runnable. The token returned can be any combination of alphanumeric characters, digits, and the special characters period (.), colon (:), underscore (_), or hyphen (-). If an invalid token is returned, or if the returned token would result in a non-unique context path, then the procedure is called again until a valid and usable token is returned (or until 93 retries have failed). If this procedure returns an empty string, then the repeat loop for the Runnable in question is terminated.");
MGCAddSnippet(397, "The following user-definable procedures are called by the vrun process when attempting to control a grid job. ");
MGCAddSnippet(398, "This procedure is called in order to fetch a list of command-line options which should be passed to the grid submission command of the following grid management systems:");
MGCAddSnippet(399, "This procedure is called in order to fetch the JobId of a job queued to the following grid management systems:");
MGCAddSnippet(400, "This procedure is called in order to fetch the current status of the job associated with an Action queued to the following grid management systems:");
MGCAddSnippet(401, "This procedure is called in order to fetch the stderr output of a job queued to the following grid management systems:");
MGCAddSnippet(402, "This procedure is called in order to kill a job queued to the following grid management systems:");
MGCAddSnippet(403, "This procedure is used to fetch, parse, and cache the current status of all jobs running on the grid.");
MGCAddSnippet(404, "This procedure is called in order to fetch the cached status of a specific Action. The <gridtype>CacheStatus procedure must have been called at least once prior to calling this procedure.");
MGCAddSnippet(405, "This procedure is called in order to fetch the raw output of the grid status command for debug purposes. The <gridtype>CacheStatus procedure must have been called at least once prior to calling this procedure.");
MGCAddSnippet(406, "These user-definable procedures allow you to override error/warning message generation and user message generation in the log file. ");
MGCAddSnippet(407, "This procedure is executed once the pass/fail status of each Action has been determined. The purpose of this procedure is to report the outcome of the Action to the vrun log output. It is called once per Action, regardless of whether the Action passed or failed. It is also called prior to the decision to re-run the Action so that initial failures are reported to log output, even if the Action is queued for re-execution.");
MGCAddSnippet(408, "This procedure is executed in response to the receipt of a user-generated informational message from the Action script. The purpose of this procedure is to report the content of the message to the vrun log output. These messages are optional and asynchronous to the VRM flow (save that informational messages can only be received from an Action script that is currently executing).");
MGCAddSnippet(409, "The procedures in the linked sections listed below are not user-definable but are defined in the same namespace so that the various user-defined override procedures can make use of the lower-level facilities in the VRM code.");
MGCAddSnippet(410, "These are general utilities that do not fall under any of the other categories:");
MGCAddSnippet(411, "This procedure determines whether the -testname option was specified to the vrun command.");
MGCAddSnippet(412, "This procedure returns the testname, if any, associated with an Action.");
MGCAddSnippet(413, "This procedure seeds the TCL random number generator. It is called automatically by VRM each time an RMDB file is expanded if the -mseed command-line option is passed to vrun.");
MGCAddSnippet(414, "Returns one or more random integers generated by the (potentially pre-seeded) TCL random number generator. If the optional prefix argument is specified, each generated integer is appended to this prefix string. The resulting values are returned as a TCL list.");
MGCAddSnippet(415, "This procedure reads a standard testlist file and returns a list of expanded  tests  (Runnable instances) based on the contents of the testlist file. The path passed to this procedure may contain wildcards which will be expanded by the TCL glob command and, of the matching files, the file with the most recent modification date will be read.");
MGCAddSnippet(416, "This procedure reads a standard testlist file and returns a list of expanded testnames suitable for use in the foreach attribute of a repeating Runnable. The path passed to this procedure may contain wildcards which will be expanded by the TCL glob command and, of the matching files, the file with the most recent modification date will be read. ");
MGCAddSnippet(417, "This procedure returns a path to the most recently modified file which matches the passed pattern. The path passed to this procedure may contain wildcards which will be expanded by the TCL glob command and, of the matching files, the file with the most recent modification date will be read. ");
MGCAddSnippet(418, "This procedure returns the contents of the most recently modified file which matches the passed pattern. The path passed to this procedure may contain wildcards which will be expanded by the TCL glob command and, of the matching files, the file with the most recent modification date will be read. ");
MGCAddSnippet(419, "This procedure returns the counters associated with a given categorization of Actions.");
MGCAddSnippet(420, "This procedure returns the current date and time as a formatted string.");
MGCAddSnippet(421, "This procedure takes a list of tokens from an RMDB parameter and returns the tokens from the list, one at a time.");
MGCAddSnippet(422, "This procedure searches for and returns any stderr output from a specified Action. The stderr output might be used to analyze the pass/fail status of an Action or as part of a failure message on the vrun log output. The procedure takes, as input, the context string of the Action whose stderr output is to be fetched and returns the relevant contents.");
MGCAddSnippet(423, "Translates the extstatus value into a human-readable string during generation of text and HTML reports and when displaying status values in the GUI. You can call this procedure from any user-definable procedure but may not override its behavior.");
MGCAddSnippet(424, "Translates the runstatus value into a human-readable string during generation of text and HTML reports and when displaying status values in the GUI. You can call this procedure from any user-definable procedure but may not override its behavior.");
MGCAddSnippet(425, "The following procedures can be used to manipulate relative paths with respect to the various directory trees known and/or managed by VRM:");
MGCAddSnippet(426, "This procedure combines a list of directory components into a single path, prepended with the absolute path of the top-most directory of the VRM Data area (path given by the -vrmdata option), and normalizes the result for the local platform.");
MGCAddSnippet(427, "This procedure combines a list of directory components into a single path, pre-pended with the absolute path of the directory from which vrun is launched, and normalizes the result for the local platform.");
MGCAddSnippet(428, "This procedure combines a list of directory components into a single path, prepended with the absolute path of the directory from which the RMDB database is loaded, and normalizes the result for the local platform.");
MGCAddSnippet(429, "This procedure combines a list of directory components into a single path, pre-pended with the absolute path of the directory from which the vrun application is loaded (which is also the directory in which other Questa utilities can be found), and normalizes the result for the local platform.");
MGCAddSnippet(430, "This procedure converts an Action path into a directory path that refers to a file within the working directory for said Action. This is useful for locating the Action's log file should a user-definable procedure wish to emit a message suggesting that the user refer to the Action's log file for more details. The resulting absolute path is not checked against the directory for validation.");
MGCAddSnippet(431, "This procedure converts an Action path into one or more strings that refer to files within the working directory for said Action. This is useful for locating log files related to a given Action should a user-definable procedure wish to emit a message suggesting that the user refer to the Action's log file for details.");
MGCAddSnippet(432, "These procedures support the creation, modification, and deletion of directories, files, and symbolic links from within a user-definable procedure. ");
MGCAddSnippet(433, "This procedure verifies that the path in question is within the reach of VRM, defined as anywhere under the VRMDATA directory or anywhere under the directory from which the vrun process was originally launched. All other paths are off limits for file generation, modification, or deletion.");
MGCAddSnippet(434, "Creates a directory, if it does not already exist. Directory creation is recursive so parent directories that do not already exist are also silently created. ");
MGCAddSnippet(435, "Writes the specified lines to the specified file. Any existing content in the file is deleted. This procedure calls VerifySafeTarget to ensure that the file to be written lies within a part of the directory tree to which VRM has write authority.");
MGCAddSnippet(436, "Appends the specified lines to the specified file, preserving any existing content. This procedure calls VerifySafeTarget to ensure that the file to be written lies within a part of the directory tree to which VRM has write authority.");
MGCAddSnippet(437, "Copies the contents of one file to a file in another location, creating the target file if necessary and/or overwriting any existing content. If parent directories of the target path do not exist, they are created. This procedure calls VerifySafeTarget to ensure that the target file lies within a part of the directory tree to which VRM has write authority (the source path is not checked and can be any path for which the user has read access).");
MGCAddSnippet(438, "Creates a symbolic link from an existing path to another location (supported only on platforms that support symbolic links). If parent directories of the target path do not exist, they are created, although the trailing component of the target path will always end up as a symbolic link. This procedure calls VerifySafeTarget to ensure that the directory in which the link is to be created lies within a part of the directory tree to which VRM has write authority (the source path is not checked and can be any path in the directory structure).");
MGCAddSnippet(439, "Reads and returns the contents of the specified file, stripped of comments and blank lines, and returned as a list (one element per line).");
MGCAddSnippet(440, "Reads and returns the contents of the specified file as a list (one element per line).");
MGCAddSnippet(441, "Adds one or more files and/or directories to an internal  no delete  list. Wildcards may be included in the file/directory arguments. Relative files and/or directories are first expanded using the most recent base directory, which may also be an absolute or relative path. The base directory starts out blank. If, after the initial expansion, the resulting path is still relative, it is expanded with respect to the top-mode level of the VRM Data directory. Following this, any wildcards in the resulting absolute paths are expanded, and the resulting paths are added to the  no delete  list. Only files that actually exist at the time the DoNotDelete procedure is called are added to the file; this means an entire directory of files may be added to the  no delete  list with a single wildcard argument. In the event the wildcard expansion results in an empty list, the expanded path itself is added to the  no delete  list (just in case the wildcard is a literal file/directory name or the path represents an explicit reference to a file that does not yet exist).");
MGCAddSnippet(442, "The following procedures are used to support parameter expansion or set/change the parameter value from within a user-definable procedure:");
MGCAddSnippet(443, "Allows a user-defined TCL procedure to set or change the value of a parameter. The change is effective only for the specified Action. The new value remains effective for the duration of the regression run or until another value is assigned by this same procedure.");
MGCAddSnippet(444, "Expand the parameters in an arbitrary string from the point of view of a given Action.");
MGCAddSnippet(445, "The following procedures simplify access to UCDB files from user-definable procedures:");
MGCAddSnippet(446, "Fetches the value of the specified attribute from a singleton test data record in the specified UCDB file. By default, this procedure makes use of a C-based TCL library that calls the UCDB API in read-streaming mode to fetch the test data records.");
MGCAddSnippet(447, "Fetches a summary attribute value from a given UCDB file. By default, this procedure makes use of a C-based TCL library that calls the UCDB API in read-streaming mode to fetch the summary records. The GetUcdbSummaryAttribute attribute gives the user access to the global summary attributes.");
MGCAddSnippet(448, "Fetches the value of the SEED attribute from a singleton test data record in the specified UCDB file. Uses GetUcdbTestAttribute to fetch the attribute value.");
MGCAddSnippet(449, "Fetches the value of the TESTSTATUS attribute from a singleton test data record in the specified UCDB file. Uses GetUcdbTestAttribute to fetch the attribute value.");
MGCAddSnippet(450, "This procedure records (counts) the UCDB status passed as the sole input argument and returns either the string  passed  or the string  failed,  according to the status.");
MGCAddSnippet(451, "This procedure determines if a given UCDB file is a coverstore.");
MGCAddSnippet(452, "This procedure tests whether a given UCDB file is a result of testplan import.");
MGCAddSnippet(453, "This procedure tests whether a given UCDB file is a sweep UCDB from a Questa ADMS flow.");
MGCAddSnippet(454, "This procedure determines the maximum TESTSTATUS of all the tests in a mergefile.");
MGCAddSnippet(455, "Translates the status string returned by the GetUcdbStatus procedure into a more aesthetically pleasing form for use in status reports.");
MGCAddSnippet(456, "This procedure checks for the presence of a lock on a specified UCDB file. ");
MGCAddSnippet(457, "This procedure sorts UCDB files from coverstores and those with invalid paths. ");
MGCAddSnippet(458, "The following procedures simplify access to the event log file from a user-definable procedure:");
MGCAddSnippet(459, "Scan for and fetch  done  status event messages from the event log for the current regression run. This procedure can be passed one or more options to select how the records are scanned and what information is to be returned. The return value is a list containing one element per matching status event message, the content of which is the returned data string.");
MGCAddSnippet(460, "Scans for  done  status event messages from the event log for the current regression run and returns a list of Action context chains for all matching events. This is implemented as FetchEventRecords -return action so all the selection options listed under that procedure are supported.");
MGCAddSnippet(461, "Scans for  done  status event messages from the event log for the current regression run and returns a list of UCDB files for all matching events. This is implemented as FetchEventRecords -return ucdbfile so all the selection options listed under that procedure are supported.");
MGCAddSnippet(462, "List of TCL utility procedures related to VRM Email functionality");
MGCAddSnippet(463, "This procedure examines the RMDB that looks for relevant email settings and, if the required settings are found, composes and sends an email message. The built-in default values are used for any settings which are not provided in the input argument and are not found in the relevant RMDB parameters.");
MGCAddSnippet(464, "This procedure returns the pre-canned signature which is appended to the bottom of every email generated by the AutoEmail procedure.");
MGCAddSnippet(465, "This procedure returns a string containing one or more of the status summary sections emitted to the vrun standard output at the end of a regression run. It may be used to compose the body of an email message to be sent either during the regression run (with partial results) or at the end of the regression run.");
MGCAddSnippet(466, "This procedure is used for initializing an email settings list with default values.");
MGCAddSnippet(467, "This procedure is used to fetch the relevant email settings from one or more RMDB parameters.");
MGCAddSnippet(468, "Composes and sends an email message. This procedure uses the built-in default values for any settings which are not provided in the input argument.");
MGCAddSnippet(469, "VRM RMDB database is implemented as an XML file. The VRM application uses the API defined in this document to access the data in the database. The API is designed to support the semantics of the database, and not necessarily its implementation. It should be possible to implement an equivalent database using, for example, an SQL-compatible library and use the same API to access the data.");
MGCAddSnippet(470, "There are seven main types of data elements in the VRM database. These types are as follows: ");
MGCAddSnippet(471, "In hardware design, there is a  data path  and the  control path.  The data path generally takes the form of a multi-bit bus and any value that can be represented in the given number of bits can be conveyed via that data bus. The control path is discrete and can only take on the states for which it was designed.");
MGCAddSnippet(472, "The TCL tokens representing names and/or strings associated with objects in the database are described in this section. ");
MGCAddSnippet(473, "Like most TCL commands, the RMDB API command keywords can be abbreviated. For example, instead of:");
MGCAddSnippet(474, "The following tables describe the attributes defined for each element in the RMDB database. Attributes other than the ones listed can be added to the XML file but are recognized by neither VRM or the RMDB Edit GUI. In addition, if non-supported attributes are added to the database XML file, there is a non-zero chance their names can collide with supported attributes in a future release. User-defined attribute names should be prefixed by a company specific string to reduce the risk of such name collisions.");
MGCAddSnippet(475, "The XML format does not require defined attributes to actually be specified in any given XML file. For the most part, an attribute that is not specified for a given element assumes the empty string as its default value. This property makes creation of an RMDB file less tedious, as attributes whose value would consist of an empty string can be omitted from the file. There are a few attributes, however, whose value must take on one of a list of possible strings. An empty string on one of these attributes would be meaningless. For most of these attributes, the API returns a default value if the attribute is not specified in the XML file.");
MGCAddSnippet(476, "In VRM, parameters and action scripts defined in a group are  inherited  by the members of that group (recursively, if necessary). In other words, assume a group alltests has, as a member, a test test1. Assume, also, that test1 does not define a parameter by the name of fred but a parameter of that name is defined by the group alltests. An action script command within test1 that includes the macro (%fred%), when expanded, will satisfy that macro with the value of the fred parameter in the group alltests because test1 does not define a parameter by that name. Action scripts also inherit in the same way.");
MGCAddSnippet(477, "A Document Type Definition (DTD) file is included in the Questa release (vm_src/rmdb.dtd). The validate command can be used to validate the contents of a given RMDB file but this validation is not performed by default in either VRM or the RMDB Edit GUI. The validation process checks to be sure that the elements in the file occur in legal places and that the attributes on each have legal values (including checking whether the enumerated-type attributes have values from their respective enumerated lists.");
MGCAddSnippet(478, "The LibXML2 parser used in the RMDB API includes support for XInclude, a standard for defining and importing nested XML files. In the RMDB API, the XInclude expansion is only performed if the current XInclude namespace is defined in the document (rmdb) element. For example,");
MGCAddSnippet(479, "The following API commands are used to open/close and manage VRM database files. When the rmdb TCL package is loaded, the rmdb command is defined. This command is used to open a database file. Each open database is assigned a unique handle. This handle is used as the TCL command for all subsequent accesses to that particular in-memory database. The XML file is parsed completely when the database is open and there is no further access to the file. If modifications are made to the in-memory database, it must be written out in order to affect the XML file on the disk.");
MGCAddSnippet(480, "The following commands are used to read information from the VRM database. The  command  used in each case is the handle (dbHandle) returned from the rmdb open command.");
MGCAddSnippet(481, "The following API commands are used to modify an open VRM database. The write-access API consists of the add, clear, and delete commands and (in the case of runnable elements), the copy command. The add command adds a data item to an existing element (possibly overwriting an existing data item). The clear command removes a specified type of content from an existing element. The delete command deletes the selected element from the database. The copy command clones a runnable element under a new name.");
MGCAddSnippet(482, "Some applications (such as the Edit GUI) require quick access to a list of parents of a given Runnable. Since building such a list requires complete traversal of the entire database, a layer exists to cache the membership topology information (parent-to-child and child-to-parent) as it changes. The cache is refreshed when the RMDB file is first opened or upon command. Write-mode API commands are monitored and the cache is updated as the underlying RMDB is updated. As with the raw API, multiple cached RMDB files can be open at any one time and each has its own cache.");
MGCAddSnippet(483, "Creating an instance of the CachedRmdb object opens or creates an RMDB database via the API. In general, the commands that the CachedRmdb object accepts are the same as those listed for the raw API above. The new, open, close, and expand API commands are not supported, as these are handled internal to the class implementation.");
MGCAddSnippet(484, "In addition to the commands documented in the sections above (the basic Read-mode and Write-mode API commands), the CachedRmdb class provides its own unique commands. As with the raw API commands, these subcommand keywords can be abbreviated.");
MGCAddSnippet(485, "The following command behaves somewhat differently when using a CachedRmdb object as opposed to the raw RMDB API:");
MGCAddSnippet(486, "The changes described in this Appendix applies only to release 10.1 and beyond.");
MGCAddSnippet(487, "The default name for the directory within which vrun launches Actions as part of a regression run is VRMDATA. When this directory is referred to in the VRM GUI or in vrun error messages, it is referred to as the VRM Data directory. This documentation refers to this directory using either VRMDATA directory or VRM Data directory. The second form (VRM Data) should always capitalize Data to distinguish between this specific directory and any random directory that may include data related to VRM. The term VRMDATA is used as a generic reference to the directory used by vrun, even if the user specifies some other name for the directory using the -vrmdata command-line option. ");
MGCAddSnippet(488, "The command-line option to set the name of the directory used by vrun to launch Action scripts changes from -scratch to -vrmdata. The -scratch command-line option will continue to be supported for the foreseeable future but it will no longer be documented and should be considered deprecated.");
MGCAddSnippet(489, "The pre-defined parameter used to access the path specified with the -vrmdata command-line option will be DATADIR (to match the other DIR parameters like RMDBDIR and VRUNDIR). The SCRATCH pre-defined parameter will continue to be supported for the foreseeable future, but it will no longer be documented and should be considered deprecated.");
MGCAddSnippet(490, "The user-definable procedures such as AnalyzePassFail, OkToMerge, and others are passed the name of a userdata array containing various values relevant to the Action on whose behalf the procedure was called. One of the elements of this array in pre-10.1 releases was called SCRATCH. A new element by the name of DATADIR has been introduced and will contain the current value of the -vrmdata command-line option (or the default directory name, if the command-line option was not specified). The SCRATCH data element in the userdata array will continue to be supported for the foreseeable future, but it will no longer be documented and should be considered deprecated.");
MGCAddSnippet(491, "The Run Manager Database (RMDB) file is an XML file that describes the topology of one or more regression test suites. You should model each regression suite as a tree, where non-leaf nodes represent groups of leaf nodes or other non-leaf nodes. ");
MGCAddSnippet(492, "These are the elements, shown roughly in top-down order, that may appear in an RMDB file. ");
MGCAddSnippet(493, "The rmdb element is the top-level element of every RMDB file. ");
MGCAddSnippet(494, "The runnable element describes one node in the regression tree. ");
MGCAddSnippet(495, "The parameters element is a container for zero or more parameter elements. ");
MGCAddSnippet(496, "The members element is a container for zero or more member elements. ");
MGCAddSnippet(497, "The localfile element specifies a file that is to be generated, copied, or symbolically linked into the working directory associated with the runnable element in which it is found.");
MGCAddSnippet(498, "The preScript element defines an Action script that is executed prior to executing the member runnable elements defined in a group runnable element. ");
MGCAddSnippet(499, "The execScript element defines the Action script which is executed in association with a task or group runnable element. ");
MGCAddSnippet(500, "The postScript element defines an Action script which is executed after the member runnable elements defined in a group runnable element have completed. ");
MGCAddSnippet(501, "The mergeScript element overrides the default Action script which is executed by auto-merge in order to merge one or more leaf-level UCDBs into a common merged UCDB file.");
MGCAddSnippet(502, "The tplanScript element overrides the default Action script which is executed by automatic testplan import.");
MGCAddSnippet(503, "The trendScript element overrides the default Action script which is executed by auto-trend in order to perform trending analysis of merged files from the auto-merge functionality.");
MGCAddSnippet(504, "The triageScript element overrides the default Action script which is executed by auto-triage in order to import the messages associated with the test stored in one or more UCDB files into a Triage Database (TDB) file.");
MGCAddSnippet(505, "The method element provides a way to control the execution of one or more Action scripts.");
MGCAddSnippet(506, "The command element specifies one line of an Action script, localfile element, or execution method. ");
MGCAddSnippet(507, "The usertcl element specifies a block of TCL code which may be optionally loaded into VRM during initialization. ");
MGCAddSnippet(508, "This appendix provides a reference to the various versions of the Run Manager Database (RMDB). ");
MGCAddSnippet(509, "This section provides a description of how the different versions vary from each other.");
MGCAddSnippet(510, "This version is the original RMDB format.");
MGCAddSnippet(511, "This version introduces a change in the way execution method commands are parsed. ");

